(41, '2019-03-08 12:49:14', 'NEW_LEARNING_TEXT_ANSWER', 's1', 'Y', '#EMAIL_FROM#', '#EMAIL_TO#', '#SITE_NAME#: #COURSE_NAME#: #MESSAGE_TITLE#', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nКурс:#COURSE_NAME#\nТест:#TEST_NAME#\n\nПользователь: #USER#\nДата: #DATE#\n\nВопрос:\n------------------------------------------\n#QUESTION_TEXT#\n------------------------------------------\n\nОтвет:\n------------------------------------------\n#ANSWER_TEXT#\n------------------------------------------\n\nДля просмотра и редактирования ответа воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/learn_test_result_edit.php?lang=ru&ID=#ID#&ATTEMPT_ID=#ATTEMPT_ID#\n\nСообщение сгенерировано автоматически.', 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\n\nКурс:<?=$arParams[\"COURSE_NAME\"];?>\n\nТест:<?=$arParams[\"TEST_NAME\"];?>\n\n\nПользователь: <?=$arParams[\"USER\"];?>\n\nДата: <?=$arParams[\"DATE\"];?>\n\n\nВопрос:\n------------------------------------------\n<?=$arParams[\"QUESTION_TEXT\"];?>\n\n------------------------------------------\n\nОтвет:\n------------------------------------------\n<?=$arParams[\"ANSWER_TEXT\"];?>\n\n------------------------------------------\n\nДля просмотра и редактирования ответа воспользуйтесь ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/bitrix/admin/learn_test_result_edit.php?lang=ru&ID=<?=$arParams[\"ID\"];?>&ATTEMPT_ID=<?=$arParams[\"ATTEMPT_ID\"];?>\n\n\nСообщение сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(57, '2019-03-08 12:51:24', 'SENDER_SUBSCRIBE_CONFIRM', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', '#SITE_NAME#: Подтверждение подписки', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nЗдравствуйте,\n\nВы получили это сообщение, так как ваш адрес был подписан\nна список рассылки сервера #SERVER_NAME#.\n\nДополнительная информация о подписке:\n\nАдрес подписки (email) ............ #EMAIL#\nДата добавления/редактирования .... #DATE#\nСписок рассылок:\n#MAILING_LIST#\n\n\nДля подтверждения подписки перейдите по следующей ссылке:\nhttp://#SERVER_NAME##CONFIRM_URL#\n\n\nВнимание! Вы не будете получать сообщения рассылки, пока не подтвердите\nсвою подписку.\nЕсли вы не подписывались на рассылку и получили это письмо по ошибке,\nпроигнорируйте его.\n\nСообщение сгенерировано автоматически.\n', 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\n\nЗдравствуйте,\n\nВы получили это сообщение, так как ваш адрес был подписан\nна список рассылки сервера <?=$arParams[\"SERVER_NAME\"];?>.\n\nДополнительная информация о подписке:\n\nАдрес подписки (email) ............ <?=$arParams[\"EMAIL\"];?>\n\nДата добавления/редактирования .... <?=$arParams[\"DATE\"];?>\n\nСписок рассылок:\n<?=$arParams[\"MAILING_LIST\"];?>\n\n\n\nДля подтверждения подписки перейдите по следующей ссылке:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"CONFIRM_URL\"];?>\n\n\n\nВнимание! Вы не будете получать сообщения рассылки, пока не подтвердите\nсвою подписку.\nЕсли вы не подписывались на рассылку и получили это письмо по ошибке,\nпроигнорируйте его.\n\nСообщение сгенерировано автоматически.\n', 'text', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
