(73, '2019-03-08 12:52:51', 'TICKET_NEW_FOR_TECHSUPPORT', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#SUPPORT_EMAIL#', '[TID##ID#] #SERVER_NAME#: Новое обращение', 'Новое обращение # #ID# в службу техподдержки сайта #SERVER_NAME#.\n#SPAM_MARK#\nОт кого: #SOURCE##OWNER_SID##OWNER_TEXT#\n\nТема: #TITLE# \n\n>======================= СООБЩЕНИЕ ===================================\n\n#FILES_LINKS##MESSAGE_BODY#\n\n>=====================================================================\n\nОтветственный     - #RESPONSIBLE_TEXT#\nКатегория         - #CATEGORY#\nКритичность       - #CRITICALITY#\nУровень поддержки - #SLA#\nСоздано           - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##ADMIN_EDIT_URL#?ID=#ID#&lang=#LANGUAGE_ID#\n\nПисьмо сгенерировано автоматически. \n', 'Новое обращение # <?=$arParams[\"ID\"];?> в службу техподдержки сайта <?=$arParams[\"SERVER_NAME\"];?>.\n<?=$arParams[\"SPAM_MARK\"];?>\n\nОт кого: <?=$arParams[\"SOURCE\"];?><?=$arParams[\"OWNER_SID\"];?><?=$arParams[\"OWNER_TEXT\"];?>\n\n\nТема: <?=$arParams[\"TITLE\"];?> \n\n>======================= СООБЩЕНИЕ ===================================\n\n<?=$arParams[\"FILES_LINKS\"];?><?=$arParams[\"MESSAGE_BODY\"];?>\n\n\n>=====================================================================\n\nОтветственный     - <?=$arParams[\"RESPONSIBLE_TEXT\"];?>\n\nКатегория         - <?=$arParams[\"CATEGORY\"];?>\n\nКритичность       - <?=$arParams[\"CRITICALITY\"];?>\n\nУровень поддержки - <?=$arParams[\"SLA\"];?>\n\nСоздано           - <?=$arParams[\"CREATED_TEXT\"];?><?=$arParams[\"CREATED_MODULE_NAME\"];?> [<?=$arParams[\"DATE_CREATE\"];?>]\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"ADMIN_EDIT_URL\"];?>?ID=<?=$arParams[\"ID\"];?>&lang=<?=$arParams[\"LANGUAGE_ID\"];?>\n\n\nПисьмо сгенерировано автоматически. \n', 'text', '#SUPPORT_ADMIN_EMAIL#', NULL