(138, 'ru', 'STATISTIC_DAILY_REPORT', 'Ежедневная статистика сайта', '#EMAIL_TO# - email администратора сайта\n#SERVER_TIME# - время на сервере в момент отсылки отчета\n#HTML_HEADER# - открытие тэга HTML + CSS стили\n#HTML_COMMON# - таблица посещаемости сайта (хиты, сессии, хосты, посетители, события) (HTML)\n#HTML_ADV# - таблица рекламных кампаний (TOP 10) (HTML)\n#HTML_EVENTS# - таблица типов событий (TOP 10) (HTML)\n#HTML_REFERERS# - таблица ссылающихся сайтов (TOP 10) (HTML)\n#HTML_PHRASES# - таблица поисковых фраз (TOP 10) (HTML)\n#HTML_SEARCHERS# - таблица индексации сайта (TOP 10) (HTML)\n#HTML_FOOTER# - закрытие тэга HTML\n', 100),
(139, 'en', 'STATISTIC_ACTIVITY_EXCEEDING', 'Visitor activity limit exceeded', '#ACTIVITY_TIME_LIMIT# - test time period (sec.)\n#ACTIVITY_HITS# - number of hits for test period\n#ACTIVITY_HITS_LIMIT# - max number of hits for test period\n#ACTIVITY_EXCEEDING# - activity exceeding\n#CURRENT_TIME# - time of blocking (server time)\n#DELAY_TIME# - period of blocking\n#USER_AGENT# - UserAgent\n#SESSION_ID# - session ID\n#SESSION_LINK# - link to the session report\n#SERACHER_ID# - search engine ID\n#SEARCHER_NAME# - search engine name\n#SEARCHER_LINK# - link to search engine hit list\n#VISITOR_ID# - visitor ID\n#VISITOR_LINK# - link to the visitor profile\n#STOPLIST_LINK# - link for adding the visitor to the stop-list', 100),
(140, 'en', 'STATISTIC_DAILY_REPORT', 'Site statistics daily report', '#EMAIL_TO# - site administrator email\n#SERVER_TIME# - server time during report sending\n#HTML_HEADER# - HTML header\n#HTML_COMMON# - table of site traffic (hits, sessions, hosts, guests, events) (HTML)\n#HTML_ADV# - table of advertising campaigns (TOP 10) (HTML)\n#HTML_EVENTS# - table of event typies (TOP 10) (HTML)\n#HTML_REFERERS# - table of referring sites (TOP 10) (HTML)\n#HTML_PHRASES# - table of search phrases (TOP 10) (HTML)\n#HTML_SEARCHERS# - table of site indexing (TOP 10) (HTML)\n#HTML_FOOTER# - HTML footer\n', 100);

