INSERT INTO `b_iblock_element` (`ID`, `TIMESTAMP_X`, `MODIFIED_BY`, `DATE_CREATE`, `CREATED_BY`, `IBLOCK_ID`, `IBLOCK_SECTION_ID`, `ACTIVE`, `ACTIVE_FROM`, `ACTIVE_TO`, `SORT`, `NAME`, `PREVIEW_PICTURE`, `PREVIEW_TEXT`, `PREVIEW_TEXT_TYPE`, `DETAIL_PICTURE`, `DETAIL_TEXT`, `DETAIL_TEXT_TYPE`, `SEARCHABLE_CONTENT`, `WF_STATUS_ID`, `WF_PARENT_ELEMENT_ID`, `WF_NEW`, `WF_LOCKED_BY`, `WF_DATE_LOCK`, `WF_COMMENTS`, `IN_SECTIONS`, `XML_ID`, `CODE`, `TAGS`, `TMP_ID`, `WF_LAST_HISTORY_ID`, `SHOW_COUNTER`, `SHOW_COUNTER_START`) VALUES
(1, '2019-03-09 23:02:55', 1, '2019-03-08 23:20:07', 1, 1, 2, 'Y', '2019-03-08 21:18:52', NULL, 500, 'Загадочная «область мозга» на поверхности Марса', 11, 'Космическое агенство NASA часто делится фотографиями Марса, но недавно оно опубликовало не привычный пейзаж с красной и пыльной поверхностью, а снимок загадочной территории под названием «область мозга». Она получила такое название из-за текстуры и цвета, которые отдаленно напоминают извилины человеческого мозга. Исследователи не знают, что стало причиной образования такой поверхности, но у них есть предположение, которое связано с возможным наличием на Марсе воды.', 'text', 12, 'Космическое агенство NASA часто делится фотографиями Марса, но недавно оно опубликовало не привычный пейзаж с красной и пыльной поверхностью, а снимок загадочной территории под названием «область мозга». Она получила такое название из-за текстуры и цвета, которые отдаленно напоминают извилины человеческого мозга. Исследователи не знают, что стало причиной образования такой поверхности, но у них есть предположение, которое связано с возможным наличием на Марсе воды.\r\n\r\nНеобычная текстура образована на территории под названием Протонилус Менса, под поверхностью которой может присутствовать обледенелая вода. Именно она, по мнению исследователей и является причиной образования неровностей. Скорее всего, впадины возникают в процессе превращения твердого льда в пар. Исследователи уверены, что такую поверхность можно встретить и в других областях средних широт Красной планеты.\r\n\r\nСнимок был сделан при помощи межпланетной станции Mars Reconnaissance Orbiter (MRO), который начал функционировать в далеком 2006 году. В качестве камеры использовалась система HiRISE, которая за последнее десятилетие сделала более 52000 высококачественных снимков Красной планеты. Например, в конце 2018 года под его взор попал космический зонд InSight.\r\n\r\nЕсть мнение, что процесс формирования текстуры идет непрерывно, однако исследователям пока не удалось зафиксировать каких-либо изменений. Возможно, в скором будущем камерам удастся заснять изменения, и NASA станет ближе к раскрытию тайны образования странной «области мозга».\r\n\r\nКак вы считаете, из-за чего возникли такие неровности? Свои смелые предположения можете написать в комментариях, а обсудить тему подробнее можно в нашем Telegram-чате.', 'text', 'ЗАГАДОЧНАЯ «ОБЛАСТЬ МОЗГА» НА ПОВЕРХНОСТИ МАРСА\r\nКОСМИЧЕСКОЕ АГЕНСТВО NASA ЧАСТО ДЕЛИТСЯ ФОТОГРАФИЯМИ МАРСА, НО НЕДАВНО ОНО ОПУБЛИКОВАЛО НЕ ПРИВЫЧНЫЙ ПЕЙЗАЖ С КРАСНОЙ И ПЫЛЬНОЙ ПОВЕРХНОСТЬЮ, А СНИМОК ЗАГАДОЧНОЙ ТЕРРИТОРИИ ПОД НАЗВАНИЕМ «ОБЛАСТЬ МОЗГА». ОНА ПОЛУЧИЛА ТАКОЕ НАЗВАНИЕ ИЗ-ЗА ТЕКСТУРЫ И ЦВЕТА, КОТОРЫЕ ОТДАЛЕННО НАПОМИНАЮТ ИЗВИЛИНЫ ЧЕЛОВЕЧЕСКОГО МОЗГА. ИССЛЕДОВАТЕЛИ НЕ ЗНАЮТ, ЧТО СТАЛО ПРИЧИНОЙ ОБРАЗОВАНИЯ ТАКОЙ ПОВЕРХНОСТИ, НО У НИХ ЕСТЬ ПРЕДПОЛОЖЕНИЕ, КОТОРОЕ СВЯЗАНО С ВОЗМОЖНЫМ НАЛИЧИЕМ НА МАРСЕ ВОДЫ.\r\nКОСМИЧЕСКОЕ АГЕНСТВО NASA ЧАСТО ДЕЛИТСЯ ФОТОГРАФИЯМИ МАРСА, НО НЕДАВНО ОНО ОПУБЛИКОВАЛО НЕ ПРИВЫЧНЫЙ ПЕЙЗАЖ С КРАСНОЙ И ПЫЛЬНОЙ ПОВЕРХНОСТЬЮ, А СНИМОК ЗАГАДОЧНОЙ ТЕРРИТОРИИ ПОД НАЗВАНИЕМ «ОБЛАСТЬ МОЗГА». ОНА ПОЛУЧИЛА ТАКОЕ НАЗВАНИЕ ИЗ-ЗА ТЕКСТУРЫ И ЦВЕТА, КОТОРЫЕ ОТДАЛЕННО НАПОМИНАЮТ ИЗВИЛИНЫ ЧЕЛОВЕЧЕСКОГО МОЗГА. ИССЛЕДОВАТЕЛИ НЕ ЗНАЮТ, ЧТО СТАЛО ПРИЧИНОЙ ОБРАЗОВАНИЯ ТАКОЙ ПОВЕРХНОСТИ, НО У НИХ ЕСТЬ ПРЕДПОЛОЖЕНИЕ, КОТОРОЕ СВЯЗАНО С ВОЗМОЖНЫМ НАЛИЧИЕМ НА МАРСЕ ВОДЫ.\r\n\r\nНЕОБЫЧНАЯ ТЕКСТУРА ОБРАЗОВАНА НА ТЕРРИТОРИИ ПОД НАЗВАНИЕМ ПРОТОНИЛУС МЕНСА, ПОД ПОВЕРХНОСТЬЮ КОТОРОЙ МОЖЕТ ПРИСУТСТВОВАТЬ ОБЛЕДЕНЕЛАЯ ВОДА. ИМЕННО ОНА, ПО МНЕНИЮ ИССЛЕДОВАТЕЛЕЙ И ЯВЛЯЕТСЯ ПРИЧИНОЙ ОБРАЗОВАНИЯ НЕРОВНОСТЕЙ. СКОРЕЕ ВСЕГО, ВПАДИНЫ ВОЗНИКАЮТ В ПРОЦЕССЕ ПРЕВРАЩЕНИЯ ТВЕРДОГО ЛЬДА В ПАР. ИССЛЕДОВАТЕЛИ УВЕРЕНЫ, ЧТО ТАКУЮ ПОВЕРХНОСТЬ МОЖНО ВСТРЕТИТЬ И В ДРУГИХ ОБЛАСТЯХ СРЕДНИХ ШИРОТ КРАСНОЙ ПЛАНЕТЫ.\r\n\r\nСНИМОК БЫЛ СДЕЛАН ПРИ ПОМОЩИ МЕЖПЛАНЕТНОЙ СТАНЦИИ MARS RECONNAISSANCE ORBITER (MRO), КОТОРЫЙ НАЧАЛ ФУНКЦИОНИРОВАТЬ В ДАЛЕКОМ 2006 ГОДУ. В КАЧЕСТВЕ КАМЕРЫ ИСПОЛЬЗОВАЛАСЬ СИСТЕМА HIRISE, КОТОРАЯ ЗА ПОСЛЕДНЕЕ ДЕСЯТИЛЕТИЕ СДЕЛАЛА БОЛЕЕ 52000 ВЫСОКОКАЧЕСТВЕННЫХ СНИМКОВ КРАСНОЙ ПЛАНЕТЫ. НАПРИМЕР, В КОНЦЕ 2018 ГОДА ПОД ЕГО ВЗОР ПОПАЛ КОСМИЧЕСКИЙ ЗОНД INSIGHT.\r\n\r\nЕСТЬ МНЕНИЕ, ЧТО ПРОЦЕСС ФОРМИРОВАНИЯ ТЕКСТУРЫ ИДЕТ НЕПРЕРЫВНО, ОДНАКО ИССЛЕДОВАТЕЛЯМ ПОКА НЕ УДАЛОСЬ ЗАФИКСИРОВАТЬ КАКИХ-ЛИБО ИЗМЕНЕНИЙ. ВОЗМОЖНО, В СКОРОМ БУДУЩЕМ КАМЕРАМ УДАСТСЯ ЗАСНЯТЬ ИЗМЕНЕНИЯ, И NASA СТАНЕТ БЛИЖЕ К РАСКРЫТИЮ ТАЙНЫ ОБРАЗОВАНИЯ СТРАННОЙ «ОБЛАСТИ МОЗГА».\r\n\r\nКАК ВЫ СЧИТАЕТЕ, ИЗ-ЗА ЧЕГО ВОЗНИКЛИ ТАКИЕ НЕРОВНОСТИ? СВОИ СМЕЛЫЕ ПРЕДПОЛОЖЕНИЯ МОЖЕТЕ НАПИСАТЬ В КОММЕНТАРИЯХ, А ОБСУДИТЬ ТЕМУ ПОДРОБНЕЕ МОЖНО В НАШЕМ TELEGRAM-ЧАТЕ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '1', 'zagadochnaya-oblast-mozga-na-poverkhnosti-marsa', '', '0', NULL, 2, '2019-03-08 23:20:11'),
(2, '2019-03-09 23:01:40', 1, '2019-03-08 23:22:01', 1, 1, 1, 'Y', '2019-03-08 21:21:14', NULL, 500, 'Обнаруженный «двойник» Земли заинтересовал астрономов', 9, 'Японские астрономы проанализировали данные с космического телескопа «Кеплер» и обнаружили 15 новых экзопланет. При этом одна из них, как говорят ученые, как две капли воды похожа на нашу Землю. Единственное, что их отличает, так это размер. Обнаруженная планета, получившая индекс K2-155d, в два раза больше нашего родного мира. В то же время планета находится в «обитаемой зоне» звезды и предположительно обладает океанами и земной атмосферой, говорится в статье, опубликованной в Astronomical Journal.', 'text', 10, 'Японские астрономы проанализировали данные с космического телескопа «Кеплер» и обнаружили 15 новых экзопланет. При этом одна из них, как говорят ученые, как две капли воды похожа на нашу Землю. Единственное, что их отличает, так это размер. Обнаруженная планета, получившая индекс K2-155d, в два раза больше нашего родного мира. В то же время планета находится в «обитаемой зоне» звезды и предположительно обладает океанами и земной атмосферой, говорится в статье, опубликованной в Astronomical Journal.\r\n\r\n«Наши расчеты показывают, что у этой планеты должна быть земная атмосфера и аналогичная структура недр, однако подтвердить это мы пока не можем. Мы мало знаем о планетах, вращающихся вокруг красных карликов, так как число этих звезд заметно ниже, чем общее количество планет, открытых у звезд, похожих на Солнце», — прокомментировал Теруюки Хирано из Технологического института Токио.\r\n\r\nБлагодаря космическому телескопу «Кеплер» к настоящему моменту астрономы обнаружили почти четыре тысячи экзопланет самой разной категории. Несколько десятков из этих миров являются потенциальными «двойниками» Земли или находятся в так называемой «обитаемой зоне» своих светил. Их открытие побудило планетологов и астробиологов приступить к разработке методов, которые бы позволили оценить пригодность к жизни или же попытаться найти ее следы в их атмосфере.\r\n\r\nВ мае 2013 года телескоп вышел из строя, однако специалисты нашли способ продолжить работу в рамках так называемой миссии K2. До поломки «Кеплер» следил лишь за небольшим участком космоса, расположенном на стыке созвездий Лебедя и Лиры. После возвращения в строй телескоп наблюдает за разными участками небосвода, так как специалистам NASA приходится постоянно поворачивать его таким образом, чтобы солнечный свет не попадал в объектив. Несмотря на это, в рамках миссии K2 «Кеплер» уже успел обнаружить множество новых планет. Что касается Хирано и его команды, то их работа была направлена на анализ данных, собранных телескопом в первые три года после «воскрешения».\r\n\r\nИсследователи отмечают, что их интересовали небесные тела, вращающиеся вокруг не солнцеподобных звезд, а красных карликов — небольших и тусклых звезд, живущих очень долго по сравнению с другими типами светил и отличающихся спокойным характером (правда, как оказалось, и они могут преподносить сюрпризы). За последние два года астрономы открыли сразу несколько звездных систем и экзопланет. В их число также входит Проксима b и семь небольших миров у звезды TRAPPIST-1. Новые системы навели астрономов на мысль, что первый полноценный аналог Земли будет открыт у красного карлика, а не рядом с двойником Солнца.\r\n\r\nХирано говорит, что «Кеплер» изначально был предназначен для поиска планет у более ярких и крупных светил, что осложнило поиски у тусклых красных карликов, чья яркость почти не меняется в тот момент, когда их спутники проходят по диску светила, снижая его светимость.\r\n\r\nОбъединение данных, собранных «Кеплером» и наземными обсерваториями, работающими в инфракрасном и оптическом диапазонах, позволило решить проблему наблюдения. Ученые теперь могли определять, какие понижения в яркости были вызваны планетами, а какие — процессами, происходящими внутри самих звезд.\r\n\r\nВ итоге японские астрономы нашли сразу 15 новых небесных тел, похожих по размерам на увеличенные копии Земли. Все они вращаются вокруг своих светил на очень небольшом расстоянии — год на их поверхности длится от одного до 40 дней. По мнению ученых, практически все открытые планеты вряд ли способны поддерживать жизнь. Температурой и климатом они должны скорее напоминать Венеру.\r\n\r\nЕдинственное исключение из списка — система K2-155. Она расположена в созвездии Тельца и находится примерно в 200 световых годах от Земли. В ней имеется сразу три «суперземли», самая далекая из которых, K2-155d, расположилась в центральной части «обитаемой зоны» и, как считают планетологи, должна быть похожа по своему климату и гидрологическим условиям на Землю.\r\n\r\nПроверить все эти предположения, по словам Хирано, можно будет в самом ближайшем будущем. В конце года NASA планирует запустить на орбиту телескоп TESS, который станет наследником «Кеплера». Аппарат сможет получить первые точные данные по составу и температурам этих планет и проверит, действительно ли речь идет о полноценной «большой сестре» Земли.', 'text', 'ОБНАРУЖЕННЫЙ «ДВОЙНИК» ЗЕМЛИ ЗАИНТЕРЕСОВАЛ АСТРОНОМОВ\r\nЯПОНСКИЕ АСТРОНОМЫ ПРОАНАЛИЗИРОВАЛИ ДАННЫЕ С КОСМИЧЕСКОГО ТЕЛЕСКОПА «КЕПЛЕР» И ОБНАРУЖИЛИ 15 НОВЫХ ЭКЗОПЛАНЕТ. ПРИ ЭТОМ ОДНА ИЗ НИХ, КАК ГОВОРЯТ УЧЕНЫЕ, КАК ДВЕ КАПЛИ ВОДЫ ПОХОЖА НА НАШУ ЗЕМЛЮ. ЕДИНСТВЕННОЕ, ЧТО ИХ ОТЛИЧАЕТ, ТАК ЭТО РАЗМЕР. ОБНАРУЖЕННАЯ ПЛАНЕТА, ПОЛУЧИВШАЯ ИНДЕКС K2-155D, В ДВА РАЗА БОЛЬШЕ НАШЕГО РОДНОГО МИРА. В ТО ЖЕ ВРЕМЯ ПЛАНЕТА НАХОДИТСЯ В «ОБИТАЕМОЙ ЗОНЕ» ЗВЕЗДЫ И ПРЕДПОЛОЖИТЕЛЬНО ОБЛАДАЕТ ОКЕАНАМИ И ЗЕМНОЙ АТМОСФЕРОЙ, ГОВОРИТСЯ В СТАТЬЕ, ОПУБЛИКОВАННОЙ В ASTRONOMICAL JOURNAL.\r\nЯПОНСКИЕ АСТРОНОМЫ ПРОАНАЛИЗИРОВАЛИ ДАННЫЕ С КОСМИЧЕСКОГО ТЕЛЕСКОПА «КЕПЛЕР» И ОБНАРУЖИЛИ 15 НОВЫХ ЭКЗОПЛАНЕТ. ПРИ ЭТОМ ОДНА ИЗ НИХ, КАК ГОВОРЯТ УЧЕНЫЕ, КАК ДВЕ КАПЛИ ВОДЫ ПОХОЖА НА НАШУ ЗЕМЛЮ. ЕДИНСТВЕННОЕ, ЧТО ИХ ОТЛИЧАЕТ, ТАК ЭТО РАЗМЕР. ОБНАРУЖЕННАЯ ПЛАНЕТА, ПОЛУЧИВШАЯ ИНДЕКС K2-155D, В ДВА РАЗА БОЛЬШЕ НАШЕГО РОДНОГО МИРА. В ТО ЖЕ ВРЕМЯ ПЛАНЕТА НАХОДИТСЯ В «ОБИТАЕМОЙ ЗОНЕ» ЗВЕЗДЫ И ПРЕДПОЛОЖИТЕЛЬНО ОБЛАДАЕТ ОКЕАНАМИ И ЗЕМНОЙ АТМОСФЕРОЙ, ГОВОРИТСЯ В СТАТЬЕ, ОПУБЛИКОВАННОЙ В ASTRONOMICAL JOURNAL.\r\n\r\n«НАШИ РАСЧЕТЫ ПОКАЗЫВАЮТ, ЧТО У ЭТОЙ ПЛАНЕТЫ ДОЛЖНА БЫТЬ ЗЕМНАЯ АТМОСФЕРА И АНАЛОГИЧНАЯ СТРУКТУРА НЕДР, ОДНАКО ПОДТВЕРДИТЬ ЭТО МЫ ПОКА НЕ МОЖЕМ. МЫ МАЛО ЗНАЕМ О ПЛАНЕТАХ, ВРАЩАЮЩИХСЯ ВОКРУГ КРАСНЫХ КАРЛИКОВ, ТАК КАК ЧИСЛО ЭТИХ ЗВЕЗД ЗАМЕТНО НИЖЕ, ЧЕМ ОБЩЕЕ КОЛИЧЕСТВО ПЛАНЕТ, ОТКРЫТЫХ У ЗВЕЗД, ПОХОЖИХ НА СОЛНЦЕ», — ПРОКОММЕНТИРОВАЛ ТЕРУЮКИ ХИРАНО ИЗ ТЕХНОЛОГИЧЕСКОГО ИНСТИТУТА ТОКИО.\r\n\r\nБЛАГОДАРЯ КОСМИЧЕСКОМУ ТЕЛЕСКОПУ «КЕПЛЕР» К НАСТОЯЩЕМУ МОМЕНТУ АСТРОНОМЫ ОБНАРУЖИЛИ ПОЧТИ ЧЕТЫРЕ ТЫСЯЧИ ЭКЗОПЛАНЕТ САМОЙ РАЗНОЙ КАТЕГОРИИ. НЕСКОЛЬКО ДЕСЯТКОВ ИЗ ЭТИХ МИРОВ ЯВЛЯЮТСЯ ПОТЕНЦИАЛЬНЫМИ «ДВОЙНИКАМИ» ЗЕМЛИ ИЛИ НАХОДЯТСЯ В ТАК НАЗЫВАЕМОЙ «ОБИТАЕМОЙ ЗОНЕ» СВОИХ СВЕТИЛ. ИХ ОТКРЫТИЕ ПОБУДИЛО ПЛАНЕТОЛОГОВ И АСТРОБИОЛОГОВ ПРИСТУПИТЬ К РАЗРАБОТКЕ МЕТОДОВ, КОТОРЫЕ БЫ ПОЗВОЛИЛИ ОЦЕНИТЬ ПРИГОДНОСТЬ К ЖИЗНИ ИЛИ ЖЕ ПОПЫТАТЬСЯ НАЙТИ ЕЕ СЛЕДЫ В ИХ АТМОСФЕРЕ.\r\n\r\nВ МАЕ 2013 ГОДА ТЕЛЕСКОП ВЫШЕЛ ИЗ СТРОЯ, ОДНАКО СПЕЦИАЛИСТЫ НАШЛИ СПОСОБ ПРОДОЛЖИТЬ РАБОТУ В РАМКАХ ТАК НАЗЫВАЕМОЙ МИССИИ K2. ДО ПОЛОМКИ «КЕПЛЕР» СЛЕДИЛ ЛИШЬ ЗА НЕБОЛЬШИМ УЧАСТКОМ КОСМОСА, РАСПОЛОЖЕННОМ НА СТЫКЕ СОЗВЕЗДИЙ ЛЕБЕДЯ И ЛИРЫ. ПОСЛЕ ВОЗВРАЩЕНИЯ В СТРОЙ ТЕЛЕСКОП НАБЛЮДАЕТ ЗА РАЗНЫМИ УЧАСТКАМИ НЕБОСВОДА, ТАК КАК СПЕЦИАЛИСТАМ NASA ПРИХОДИТСЯ ПОСТОЯННО ПОВОРАЧИВАТЬ ЕГО ТАКИМ ОБРАЗОМ, ЧТОБЫ СОЛНЕЧНЫЙ СВЕТ НЕ ПОПАДАЛ В ОБЪЕКТИВ. НЕСМОТРЯ НА ЭТО, В РАМКАХ МИССИИ K2 «КЕПЛЕР» УЖЕ УСПЕЛ ОБНАРУЖИТЬ МНОЖЕСТВО НОВЫХ ПЛАНЕТ. ЧТО КАСАЕТСЯ ХИРАНО И ЕГО КОМАНДЫ, ТО ИХ РАБОТА БЫЛА НАПРАВЛЕНА НА АНАЛИЗ ДАННЫХ, СОБРАННЫХ ТЕЛЕСКОПОМ В ПЕРВЫЕ ТРИ ГОДА ПОСЛЕ «ВОСКРЕШЕНИЯ».\r\n\r\nИССЛЕДОВАТЕЛИ ОТМЕЧАЮТ, ЧТО ИХ ИНТЕРЕСОВАЛИ НЕБЕСНЫЕ ТЕЛА, ВРАЩАЮЩИЕСЯ ВОКРУГ НЕ СОЛНЦЕПОДОБНЫХ ЗВЕЗД, А КРАСНЫХ КАРЛИКОВ — НЕБОЛЬШИХ И ТУСКЛЫХ ЗВЕЗД, ЖИВУЩИХ ОЧЕНЬ ДОЛГО ПО СРАВНЕНИЮ С ДРУГИМИ ТИПАМИ СВЕТИЛ И ОТЛИЧАЮЩИХСЯ СПОКОЙНЫМ ХАРАКТЕРОМ (ПРАВДА, КАК ОКАЗАЛОСЬ, И ОНИ МОГУТ ПРЕПОДНОСИТЬ СЮРПРИЗЫ). ЗА ПОСЛЕДНИЕ ДВА ГОДА АСТРОНОМЫ ОТКРЫЛИ СРАЗУ НЕСКОЛЬКО ЗВЕЗДНЫХ СИСТЕМ И ЭКЗОПЛАНЕТ. В ИХ ЧИСЛО ТАКЖЕ ВХОДИТ ПРОКСИМА B И СЕМЬ НЕБОЛЬШИХ МИРОВ У ЗВЕЗДЫ TRAPPIST-1. НОВЫЕ СИСТЕМЫ НАВЕЛИ АСТРОНОМОВ НА МЫСЛЬ, ЧТО ПЕРВЫЙ ПОЛНОЦЕННЫЙ АНАЛОГ ЗЕМЛИ БУДЕТ ОТКРЫТ У КРАСНОГО КАРЛИКА, А НЕ РЯДОМ С ДВОЙНИКОМ СОЛНЦА.\r\n\r\nХИРАНО ГОВОРИТ, ЧТО «КЕПЛЕР» ИЗНАЧАЛЬНО БЫЛ ПРЕДНАЗНАЧЕН ДЛЯ ПОИСКА ПЛАНЕТ У БОЛЕЕ ЯРКИХ И КРУПНЫХ СВЕТИЛ, ЧТО ОСЛОЖНИЛО ПОИСКИ У ТУСКЛЫХ КРАСНЫХ КАРЛИКОВ, ЧЬЯ ЯРКОСТЬ ПОЧТИ НЕ МЕНЯЕТСЯ В ТОТ МОМЕНТ, КОГДА ИХ СПУТНИКИ ПРОХОДЯТ ПО ДИСКУ СВЕТИЛА, СНИЖАЯ ЕГО СВЕТИМОСТЬ.\r\n\r\nОБЪЕДИНЕНИЕ ДАННЫХ, СОБРАННЫХ «КЕПЛЕРОМ» И НАЗЕМНЫМИ ОБСЕРВАТОРИЯМИ, РАБОТАЮЩИМИ В ИНФРАКРАСНОМ И ОПТИЧЕСКОМ ДИАПАЗОНАХ, ПОЗВОЛИЛО РЕШИТЬ ПРОБЛЕМУ НАБЛЮДЕНИЯ. УЧЕНЫЕ ТЕПЕРЬ МОГЛИ ОПРЕДЕЛЯТЬ, КАКИЕ ПОНИЖЕНИЯ В ЯРКОСТИ БЫЛИ ВЫЗВАНЫ ПЛАНЕТАМИ, А КАКИЕ — ПРОЦЕССАМИ, ПРОИСХОДЯЩИМИ ВНУТРИ САМИХ ЗВЕЗД.\r\n\r\nВ ИТОГЕ ЯПОНСКИЕ АСТРОНОМЫ НАШЛИ СРАЗУ 15 НОВЫХ НЕБЕСНЫХ ТЕЛ, ПОХОЖИХ ПО РАЗМЕРАМ НА УВЕЛИЧЕННЫЕ КОПИИ ЗЕМЛИ. ВСЕ ОНИ ВРАЩАЮТСЯ ВОКРУГ СВОИХ СВЕТИЛ НА ОЧЕНЬ НЕБОЛЬШОМ РАССТОЯНИИ — ГОД НА ИХ ПОВЕРХНОСТИ ДЛИТСЯ ОТ ОДНОГО ДО 40 ДНЕЙ. ПО МНЕНИЮ УЧЕНЫХ, ПРАКТИЧЕСКИ ВСЕ ОТКРЫТЫЕ ПЛАНЕТЫ ВРЯД ЛИ СПОСОБНЫ ПОДДЕРЖИВАТЬ ЖИЗНЬ. ТЕМПЕРАТУРОЙ И КЛИМАТОМ ОНИ ДОЛЖНЫ СКОРЕЕ НАПОМИНАТЬ ВЕНЕРУ.\r\n\r\nЕДИНСТВЕННОЕ ИСКЛЮЧЕНИЕ ИЗ СПИСКА — СИСТЕМА K2-155. ОНА РАСПОЛОЖЕНА В СОЗВЕЗДИИ ТЕЛЬЦА И НАХОДИТСЯ ПРИМЕРНО В 200 СВЕТОВЫХ ГОДАХ ОТ ЗЕМЛИ. В НЕЙ ИМЕЕТСЯ СРАЗУ ТРИ «СУПЕРЗЕМЛИ», САМАЯ ДАЛЕКАЯ ИЗ КОТОРЫХ, K2-155D, РАСПОЛОЖИЛАСЬ В ЦЕНТРАЛЬНОЙ ЧАСТИ «ОБИТАЕМОЙ ЗОНЫ» И, КАК СЧИТАЮТ ПЛАНЕТОЛОГИ, ДОЛЖНА БЫТЬ ПОХОЖА ПО СВОЕМУ КЛИМАТУ И ГИДРОЛОГИЧЕСКИМ УСЛОВИЯМ НА ЗЕМЛЮ.\r\n\r\nПРОВЕРИТЬ ВСЕ ЭТИ ПРЕДПОЛОЖЕНИЯ, ПО СЛОВАМ ХИРАНО, МОЖНО БУДЕТ В САМОМ БЛИЖАЙШЕМ БУДУЩЕМ. В КОНЦЕ ГОДА NASA ПЛАНИРУЕТ ЗАПУСТИТЬ НА ОРБИТУ ТЕЛЕСКОП TESS, КОТОРЫЙ СТАНЕТ НАСЛЕДНИКОМ «КЕПЛЕРА». АППАРАТ СМОЖЕТ ПОЛУЧИТЬ ПЕРВЫЕ ТОЧНЫЕ ДАННЫЕ ПО СОСТАВУ И ТЕМПЕРАТУРАМ ЭТИХ ПЛАНЕТ И ПРОВЕРИТ, ДЕЙСТВИТЕЛЬНО ЛИ РЕЧЬ ИДЕТ О ПОЛНОЦЕННОЙ «БОЛЬШОЙ СЕСТРЕ» ЗЕМЛИ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '2', 'obnaruzhennyy-dvoynik-zemli-zainteresoval-astronomov', '', '0', NULL, 3, '2019-03-08 23:22:37'),
(3, '2019-03-09 23:01:02', 1, '2019-03-08 23:29:16', 1, 1, 2, 'Y', '2019-03-08 21:27:15', NULL, 500, 'В Альпах нашли предка тираннозавров. И он пролил свет на эволюцию древних ящеров', 7, 'Считается, что крупные динозавры появились в середине Юрского периода, около 180 миллионов лет назад, а до этого по древней Земле разгуливали ящеры куда меньших размеров. Однако недавнее открытие палеонтологов может в корне изменить представление об этом временном периоде. Не так давно на территории Альпов обнаружили останки неизвестного древнего ящера, который не просто жил задолго до крупных динозавров, но и по размерам ничем им не уступал.', 'text', 8, 'Считается, что крупные динозавры появились в середине Юрского периода, около 180 миллионов лет назад, а до этого по древней Земле разгуливали ящеры куда меньших размеров. Однако недавнее открытие палеонтологов может в корне изменить представление об этом временном периоде. Не так давно на территории Альпов обнаружили останки неизвестного древнего ящера, который не просто жил задолго до крупных динозавров, но и по размерам ничем им не уступал.<br>\r\n <br>\r\n Как сообщает редакция журнала PeerJ, новый ящер получил имя Saltriovenator zanellai и обитал он на территории современной Италии около 200 миллионов лет назад. Открытие совершила группа ученых во главе с Анджело Занеллой. Всего было найдено 132 кости древнего ящера. Утверждается, что возраст динозавра составляет около 24 лет, что довольно небольшой срок для динозавров подобных размеров. Вес Saltriovenator zanellai, согласно расчетам экспертов, составляет порядка 1,3 тонн, а рост 3 метра. Динозавр ходил на четырех лапах и длина его туловища также равняется 3 метрам.<br>\r\n <br>\r\n <img width=\"750\" src=\"https://s.hi-news.ru/2018/12/yasher.@750.jpg\" height=\"678\"><br>\r\n А вот на самих лапах стоит остановиться подробнее. Дело в том, что более древних ящеров на лапах имеется 5 пальцев. В ходе эволюционных изменении один из них был утерян. При этом у известных нам обитателях середины Юрского периода на лапах уже по 3 пальца. А вот у найденного Saltriovenator zanellai количество пальцев равняется 4, что позволяет предположить, что он является своего рода промежуточным звеном между древними ящерами и их более современными потомками.<br>\r\n <br>\r\n При этом пальцы динозавра могут пролить свет еще и на тот момент, какой конкретно палец потеряли обитатели Юрского периода в ходе своей эволюции. Выражаясь современным языком, пятипалые ящеры лишились «мизинца», а сородичи тиранозавров уже были без «безымянного» пальца. Ранее считалось, что вторым утраченным пальцем, скорее всего, является «большой».<br>', 'html', 'В АЛЬПАХ НАШЛИ ПРЕДКА ТИРАННОЗАВРОВ. И ОН ПРОЛИЛ СВЕТ НА ЭВОЛЮЦИЮ ДРЕВНИХ ЯЩЕРОВ\r\nСЧИТАЕТСЯ, ЧТО КРУПНЫЕ ДИНОЗАВРЫ ПОЯВИЛИСЬ В СЕРЕДИНЕ ЮРСКОГО ПЕРИОДА, ОКОЛО 180 МИЛЛИОНОВ ЛЕТ НАЗАД, А ДО ЭТОГО ПО ДРЕВНЕЙ ЗЕМЛЕ РАЗГУЛИВАЛИ ЯЩЕРЫ КУДА МЕНЬШИХ РАЗМЕРОВ. ОДНАКО НЕДАВНЕЕ ОТКРЫТИЕ ПАЛЕОНТОЛОГОВ МОЖЕТ В КОРНЕ ИЗМЕНИТЬ ПРЕДСТАВЛЕНИЕ ОБ ЭТОМ ВРЕМЕННОМ ПЕРИОДЕ. НЕ ТАК ДАВНО НА ТЕРРИТОРИИ АЛЬПОВ ОБНАРУЖИЛИ ОСТАНКИ НЕИЗВЕСТНОГО ДРЕВНЕГО ЯЩЕРА, КОТОРЫЙ НЕ ПРОСТО ЖИЛ ЗАДОЛГО ДО КРУПНЫХ ДИНОЗАВРОВ, НО И ПО РАЗМЕРАМ НИЧЕМ ИМ НЕ УСТУПАЛ.\r\nСЧИТАЕТСЯ, ЧТО КРУПНЫЕ ДИНОЗАВРЫ ПОЯВИЛИСЬ \r\nВ СЕРЕДИНЕ ЮРСКОГО ПЕРИОДА, ОКОЛО 180 МИЛЛИОНОВ ЛЕТ НАЗАД, А ДО ЭТОГО ПО ДРЕВНЕЙ ЗЕМЛЕ РАЗГУЛИВАЛИ ЯЩЕРЫ КУДА МЕНЬШИХ РАЗМЕРОВ. ОДНАКО НЕДАВНЕЕ ОТКРЫТИЕ ПАЛЕОНТОЛОГОВ МОЖЕТ В КОРНЕ ИЗМЕНИТЬ ПРЕДСТАВЛЕНИЕ ОБ ЭТОМ ВРЕМЕННОМ ПЕРИОДЕ. НЕ ТАК ДАВНО НА ТЕРРИТОРИИ АЛЬПОВ ОБНАРУЖИЛИ ОСТАНКИ НЕИЗВЕСТНОГО ДРЕВНЕГО ЯЩЕРА, КОТОРЫЙ НЕ ПРОСТО ЖИЛ ЗАДОЛГО ДО КРУПНЫХ ДИНОЗАВРОВ, НО И ПО РАЗМЕРАМ НИЧЕМ ИМ НЕ УСТУПАЛ.\r\n\r\nКАК СООБЩАЕТ РЕДАКЦИЯ ЖУРНАЛА PEERJ, НОВЫЙ \r\nЯЩЕР ПОЛУЧИЛ ИМЯ SALTRIOVENATOR ZANELLAI И ОБИТАЛ ОН НА ТЕРРИТОРИИ СОВРЕМЕННОЙ ИТАЛИИ ОКОЛО 200 МИЛЛИОНОВ ЛЕТ НАЗАД. ОТКРЫТИЕ СОВЕРШИЛА ГРУППА УЧЕНЫХ ВО ГЛАВЕ С АНДЖЕЛО ЗАНЕЛЛОЙ. ВСЕГО БЫЛО НАЙДЕНО 132 КОСТИ ДРЕВНЕГО ЯЩЕРА. УТВЕРЖДАЕТСЯ, ЧТО ВОЗРАСТ ДИНОЗАВРА СОСТАВЛЯЕТ ОКОЛО 24 ЛЕТ, ЧТО ДОВОЛЬНО НЕБОЛЬШОЙ СРОК ДЛЯ ДИНОЗАВРОВ ПОДОБНЫХ РАЗМЕРОВ. ВЕС SALTRIOVENATOR ZANELLAI, СОГЛАСНО РАСЧЕТАМ ЭКСПЕРТОВ, СОСТАВЛЯЕТ ПОРЯДКА 1,3 ТОНН, А РОСТ 3 МЕТРА. ДИНОЗАВР ХОДИЛ НА ЧЕТЫРЕХ ЛАПАХ И ДЛИНА ЕГО ТУЛОВИЩА ТАКЖЕ РАВНЯЕТСЯ 3 МЕТРАМ.\r\n\r\n[ HTTPS://S.HI-NEWS.RU/2018/12/YASHER.@750.JPG ] \r\nА ВОТ НА САМИХ ЛАПАХ СТОИТ ОСТАНОВИТЬСЯ \r\nПОДРОБНЕЕ. ДЕЛО В ТОМ, ЧТО БОЛЕЕ ДРЕВНИХ ЯЩЕРОВ НА ЛАПАХ ИМЕЕТСЯ 5 ПАЛЬЦЕВ. В ХОДЕ ЭВОЛЮЦИОННЫХ ИЗМЕНЕНИИ ОДИН ИЗ НИХ БЫЛ УТЕРЯН. ПРИ ЭТОМ У ИЗВЕСТНЫХ НАМ ОБИТАТЕЛЯХ СЕРЕДИНЫ ЮРСКОГО ПЕРИОДА НА ЛАПАХ УЖЕ ПО 3 ПАЛЬЦА. А ВОТ У НАЙДЕННОГО SALTRIOVENATOR ZANELLAI КОЛИЧЕСТВО ПАЛЬЦЕВ РАВНЯЕТСЯ 4, ЧТО ПОЗВОЛЯЕТ ПРЕДПОЛОЖИТЬ, ЧТО ОН ЯВЛЯЕТСЯ СВОЕГО РОДА ПРОМЕЖУТОЧНЫМ ЗВЕНОМ МЕЖДУ ДРЕВНИМИ ЯЩЕРАМИ И ИХ БОЛЕЕ СОВРЕМЕННЫМИ ПОТОМКАМИ.\r\n\r\nПРИ ЭТОМ ПАЛЬЦЫ ДИНОЗАВРА МОГУТ ПРОЛИТЬ \r\nСВЕТ ЕЩЕ И НА ТОТ МОМЕНТ, КАКОЙ КОНКРЕТНО ПАЛЕЦ ПОТЕРЯЛИ ОБИТАТЕЛИ ЮРСКОГО ПЕРИОДА В ХОДЕ СВОЕЙ ЭВОЛЮЦИИ. ВЫРАЖАЯСЬ СОВРЕМЕННЫМ ЯЗЫКОМ, ПЯТИПАЛЫЕ ЯЩЕРЫ ЛИШИЛИСЬ «МИЗИНЦА», А СОРОДИЧИ ТИРАНОЗАВРОВ УЖЕ БЫЛИ БЕЗ «БЕЗЫМЯННОГО» ПАЛЬЦА. РАНЕЕ СЧИТАЛОСЬ, ЧТО ВТОРЫМ УТРАЧЕННЫМ ПАЛЬЦЕМ, СКОРЕЕ ВСЕГО, ЯВЛЯЕТСЯ «БОЛЬШОЙ».', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '3', 'v-alpakh-nashli-predka-tirannozavrov-i-on-prolil-svet-na-evolyutsiyu-drevnikh-yashcherov', '', '0', NULL, 3, '2019-03-08 23:30:49'),
(4, '2019-03-10 20:53:16', 1, '2019-03-10 20:52:08', 1, 2, NULL, 'Y', NULL, NULL, 500, 'Сборка компьютеров на заказ', 14, 'Компания основана в 2009 году и является официальным партнером таких известных технологических компаний как: NVIDIA, Intel, ASUS, MSI, Cooler Master, Corsair и многих других. Также мы реализовали не один совместный проект с такими разработчиками игр, как: Wargaming, UBISOFT, Electronic Arts, Bethesda, Mail.Games.', 'text', 15, 'Компания основана в 2009 году и является официальным партнером таких известных технологических компаний как: NVIDIA, Intel, ASUS, MSI, Cooler Master, Corsair и многих других. Также мы реализовали не один совместный проект с такими разработчиками игр, как: Wargaming, UBISOFT, Electronic Arts, Bethesda, Mail.Games.\r\n\r\nГлавный офис компании, шоурум и сборка находятся в Москве. Мы осуществляем доставку компьютеров по всей России и миру. Наша компания работает как с частными лицами, так и с юридическими лицами.', 'text', 'СБОРКА КОМПЬЮТЕРОВ НА ЗАКАЗ\r\nКОМПАНИЯ ОСНОВАНА В 2009 ГОДУ И ЯВЛЯЕТСЯ ОФИЦИАЛЬНЫМ ПАРТНЕРОМ ТАКИХ ИЗВЕСТНЫХ ТЕХНОЛОГИЧЕСКИХ КОМПАНИЙ КАК: NVIDIA, INTEL, ASUS, MSI, COOLER MASTER, CORSAIR И МНОГИХ ДРУГИХ. ТАКЖЕ МЫ РЕАЛИЗОВАЛИ НЕ ОДИН СОВМЕСТНЫЙ ПРОЕКТ С ТАКИМИ РАЗРАБОТЧИКАМИ ИГР, КАК: WARGAMING, UBISOFT, ELECTRONIC ARTS, BETHESDA, MAIL.GAMES.\r\nКОМПАНИЯ ОСНОВАНА В 2009 ГОДУ И ЯВЛЯЕТСЯ ОФИЦИАЛЬНЫМ ПАРТНЕРОМ ТАКИХ ИЗВЕСТНЫХ ТЕХНОЛОГИЧЕСКИХ КОМПАНИЙ КАК: NVIDIA, INTEL, ASUS, MSI, COOLER MASTER, CORSAIR И МНОГИХ ДРУГИХ. ТАКЖЕ МЫ РЕАЛИЗОВАЛИ НЕ ОДИН СОВМЕСТНЫЙ ПРОЕКТ С ТАКИМИ РАЗРАБОТЧИКАМИ ИГР, КАК: WARGAMING, UBISOFT, ELECTRONIC ARTS, BETHESDA, MAIL.GAMES.\r\n\r\nГЛАВНЫЙ ОФИС КОМПАНИИ, ШОУРУМ И СБОРКА НАХОДЯТСЯ В МОСКВЕ. МЫ ОСУЩЕСТВЛЯЕМ ДОСТАВКУ КОМПЬЮТЕРОВ ПО ВСЕЙ РОССИИ И МИРУ. НАША КОМПАНИЯ РАБОТАЕТ КАК С ЧАСТНЫМИ ЛИЦАМИ, ТАК И С ЮРИДИЧЕСКИМИ ЛИЦАМИ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '4', '', '', '0', NULL, 1, '2019-03-10 21:02:59'),
(5, '2019-03-10 21:49:10', 1, '2019-03-10 20:55:47', 1, 2, NULL, 'Y', NULL, NULL, 500, 'Установка Ubuntu Linux: инструкция для пользователя Windows (в картинках, основы)', 16, 'Данная статья предназначена для тех пользователей, кто хорошо владеет компьютерами вообще и имеет большой опыт работы с Windows в частности, но плохо знает (или вообще не знает) Linux. Именно поэтому в этой статье не будет употребляться лексика, специфическая для UNIX. Обычные для Linux задачи, такие как разбиение жёсткого диска на разделы, установка программного обеспечения и подключение необходимых плагинов, будут полностью решены с помощью графического пользовательского интерфейса (GUI).\r\n', 'text', 17, 'Данная статья предназначена для тех пользователей, кто хорошо владеет компьютерами вообще и имеет большой опыт работы с Windows в частности, но плохо знает (или вообще не знает) Linux. Именно поэтому в этой статье не будет употребляться лексика, специфическая для UNIX. Обычные для Linux задачи, такие как разбиение жёсткого диска на разделы, установка программного обеспечения и подключение необходимых плагинов, будут полностью решены с помощью графического пользовательского интерфейса (GUI).\r\n\r\nПодготовка\r\nАппаратное обеспечение\r\n\r\nОдним из самых привлекательных качеств Linux является относительно низкий уровень технических требований даже к самым современным системам. Минимальные системные требования Ubuntu - это 512 Мбайт оперативной памяти и 5 Гбайт дискового пространства. Поэтому Ubuntu идеально подходит для использования в нетбуках, которые не блещут своей производительностью в Windows.\r\n\r\nКакую версию выбрать?\r\n\r\nДля начала вам нужно скачать ISO-файл c официального Web-сайта Ubuntu. Прежде всего, вас попросят выбрать между обычной версией и LTS. Новая версия Ubuntu появляется каждые шесть месяцев, а LTS-релиз выходит раз в два года. Ubuntu с индексом LTS поддерживается в течение трёх лет, помимо двух лет в течении которых эта версия будет последней. Если вы всегда стремитесь за новинками, то выбирайте обычную версию и обновляйте релиз (см. версия) каждые полгода. Если же вы хотите настроить систему и оставить её в покое, то выбирайте LTS и тогда апгрейд на следующий релиз будете делать раз в два года, если хотите оставаться всегда на LTS релизах. Заметьте ничто не мешает обновлять LTS версию на обычную каждые пол года.\r\n\r\nВыбор между 32bit или 64bit\r\n\r\nДалее нужно будет выбрать между 32-битной и 64-битной версией системы. Помните, что подобно Windows, у 64-битной версии Ubuntu будет больше проблем совместимости, чем у её 32-битного аналога. С поддержкой драйверов тоже могут возникнуть проблемы на 64-битной платформе. В конечном счёте, выбор за вами, 64-битная версия может дать большую производительность, но 32-битные системы доставят меньше хлопот, а как для начинающего пользователя это очень важно. Спросите: а как насчет поддержки оперативной памяти более 4ГБ? Ответ прост - нужно лишь будет через графический менеджер пакетов установить ядро с индексом «pae».\r\n\r\nСкачивание\r\n\r\nИтак, вы определились, какую версию Ubuntu будете использовать. Переходим по ссылке для скачивания ubuntu, в поле «Choose your flavour» выбираем 32-битную или 64-битную версию, жмем «Get Ubuntu XX.XX». Возможно после этого вам будет предложено ответить на опрос, но сейчас нас это не интересует, в конце страницы нажимаем «Not now, take me to the download ›»(перевод «Не сейчас, приступить к загрузке >»). После этого откроется страница загрузки и через несколько секунд начнется загрузка. Образ *.iso дистрибутива Ubuntu занимает размер около 700 Мб, поэтому рекомендуется использовать менеджер закачки, для того, что бы можно было докачать образ в случае разрыва соединения.', 'text', 'УСТАНОВКА UBUNTU LINUX: ИНСТРУКЦИЯ ДЛЯ ПОЛЬЗОВАТЕЛЯ WINDOWS (В КАРТИНКАХ, ОСНОВЫ)\r\nДАННАЯ СТАТЬЯ ПРЕДНАЗНАЧЕНА ДЛЯ ТЕХ ПОЛЬЗОВАТЕЛЕЙ, КТО ХОРОШО ВЛАДЕЕТ КОМПЬЮТЕРАМИ ВООБЩЕ И ИМЕЕТ БОЛЬШОЙ ОПЫТ РАБОТЫ С WINDOWS В ЧАСТНОСТИ, НО ПЛОХО ЗНАЕТ (ИЛИ ВООБЩЕ НЕ ЗНАЕТ) LINUX. ИМЕННО ПОЭТОМУ В ЭТОЙ СТАТЬЕ НЕ БУДЕТ УПОТРЕБЛЯТЬСЯ ЛЕКСИКА, СПЕЦИФИЧЕСКАЯ ДЛЯ UNIX. ОБЫЧНЫЕ ДЛЯ LINUX ЗАДАЧИ, ТАКИЕ КАК РАЗБИЕНИЕ ЖЁСТКОГО ДИСКА НА РАЗДЕЛЫ, УСТАНОВКА ПРОГРАММНОГО ОБЕСПЕЧЕНИЯ И ПОДКЛЮЧЕНИЕ НЕОБХОДИМЫХ ПЛАГИНОВ, БУДУТ ПОЛНОСТЬЮ РЕШЕНЫ С ПОМОЩЬЮ ГРАФИЧЕСКОГО ПОЛЬЗОВАТЕЛЬСКОГО ИНТЕРФЕЙСА (GUI).\r\n\r\nДАННАЯ СТАТЬЯ ПРЕДНАЗНАЧЕНА ДЛЯ ТЕХ ПОЛЬЗОВАТЕЛЕЙ, КТО ХОРОШО ВЛАДЕЕТ КОМПЬЮТЕРАМИ ВООБЩЕ И ИМЕЕТ БОЛЬШОЙ ОПЫТ РАБОТЫ С WINDOWS В ЧАСТНОСТИ, НО ПЛОХО ЗНАЕТ (ИЛИ ВООБЩЕ НЕ ЗНАЕТ) LINUX. ИМЕННО ПОЭТОМУ В ЭТОЙ СТАТЬЕ НЕ БУДЕТ УПОТРЕБЛЯТЬСЯ ЛЕКСИКА, СПЕЦИФИЧЕСКАЯ ДЛЯ UNIX. ОБЫЧНЫЕ ДЛЯ LINUX ЗАДАЧИ, ТАКИЕ КАК РАЗБИЕНИЕ ЖЁСТКОГО ДИСКА НА РАЗДЕЛЫ, УСТАНОВКА ПРОГРАММНОГО ОБЕСПЕЧЕНИЯ И ПОДКЛЮЧЕНИЕ НЕОБХОДИМЫХ ПЛАГИНОВ, БУДУТ ПОЛНОСТЬЮ РЕШЕНЫ С ПОМОЩЬЮ ГРАФИЧЕСКОГО ПОЛЬЗОВАТЕЛЬСКОГО ИНТЕРФЕЙСА (GUI).\r\n\r\nПОДГОТОВКА\r\nАППАРАТНОЕ ОБЕСПЕЧЕНИЕ\r\n\r\nОДНИМ ИЗ САМЫХ ПРИВЛЕКАТЕЛЬНЫХ КАЧЕСТВ LINUX ЯВЛЯЕТСЯ ОТНОСИТЕЛЬНО НИЗКИЙ УРОВЕНЬ ТЕХНИЧЕСКИХ ТРЕБОВАНИЙ ДАЖЕ К САМЫМ СОВРЕМЕННЫМ СИСТЕМАМ. МИНИМАЛЬНЫЕ СИСТЕМНЫЕ ТРЕБОВАНИЯ UBUNTU - ЭТО 512 МБАЙТ ОПЕРАТИВНОЙ ПАМЯТИ И 5 ГБАЙТ ДИСКОВОГО ПРОСТРАНСТВА. ПОЭТОМУ UBUNTU ИДЕАЛЬНО ПОДХОДИТ ДЛЯ ИСПОЛЬЗОВАНИЯ В НЕТБУКАХ, КОТОРЫЕ НЕ БЛЕЩУТ СВОЕЙ ПРОИЗВОДИТЕЛЬНОСТЬЮ В WINDOWS.\r\n\r\nКАКУЮ ВЕРСИЮ ВЫБРАТЬ?\r\n\r\nДЛЯ НАЧАЛА ВАМ НУЖНО СКАЧАТЬ ISO-ФАЙЛ C ОФИЦИАЛЬНОГО WEB-САЙТА UBUNTU. ПРЕЖДЕ ВСЕГО, ВАС ПОПРОСЯТ ВЫБРАТЬ МЕЖДУ ОБЫЧНОЙ ВЕРСИЕЙ И LTS. НОВАЯ ВЕРСИЯ UBUNTU ПОЯВЛЯЕТСЯ КАЖДЫЕ ШЕСТЬ МЕСЯЦЕВ, А LTS-РЕЛИЗ ВЫХОДИТ РАЗ В ДВА ГОДА. UBUNTU С ИНДЕКСОМ LTS ПОДДЕРЖИВАЕТСЯ В ТЕЧЕНИЕ ТРЁХ ЛЕТ, ПОМИМО ДВУХ ЛЕТ В ТЕЧЕНИИ КОТОРЫХ ЭТА ВЕРСИЯ БУДЕТ ПОСЛЕДНЕЙ. ЕСЛИ ВЫ ВСЕГДА СТРЕМИТЕСЬ ЗА НОВИНКАМИ, ТО ВЫБИРАЙТЕ ОБЫЧНУЮ ВЕРСИЮ И ОБНОВЛЯЙТЕ РЕЛИЗ (СМ. ВЕРСИЯ) КАЖДЫЕ ПОЛГОДА. ЕСЛИ ЖЕ ВЫ ХОТИТЕ НАСТРОИТЬ СИСТЕМУ И ОСТАВИТЬ ЕЁ В ПОКОЕ, ТО ВЫБИРАЙТЕ LTS И ТОГДА АПГРЕЙД НА СЛЕДУЮЩИЙ РЕЛИЗ БУДЕТЕ ДЕЛАТЬ РАЗ В ДВА ГОДА, ЕСЛИ ХОТИТЕ ОСТАВАТЬСЯ ВСЕГДА НА LTS РЕЛИЗАХ. ЗАМЕТЬТЕ НИЧТО НЕ МЕШАЕТ ОБНОВЛЯТЬ LTS ВЕРСИЮ НА ОБЫЧНУЮ КАЖДЫЕ ПОЛ ГОДА.\r\n\r\nВЫБОР МЕЖДУ 32BIT ИЛИ 64BIT\r\n\r\nДАЛЕЕ НУЖНО БУДЕТ ВЫБРАТЬ МЕЖДУ 32-БИТНОЙ И 64-БИТНОЙ ВЕРСИЕЙ СИСТЕМЫ. ПОМНИТЕ, ЧТО ПОДОБНО WINDOWS, У 64-БИТНОЙ ВЕРСИИ UBUNTU БУДЕТ БОЛЬШЕ ПРОБЛЕМ СОВМЕСТИМОСТИ, ЧЕМ У ЕЁ 32-БИТНОГО АНАЛОГА. С ПОДДЕРЖКОЙ ДРАЙВЕРОВ ТОЖЕ МОГУТ ВОЗНИКНУТЬ ПРОБЛЕМЫ НА 64-БИТНОЙ ПЛАТФОРМЕ. В КОНЕЧНОМ СЧЁТЕ, ВЫБОР ЗА ВАМИ, 64-БИТНАЯ ВЕРСИЯ МОЖЕТ ДАТЬ БОЛЬШУЮ ПРОИЗВОДИТЕЛЬНОСТЬ, НО 32-БИТНЫЕ СИСТЕМЫ ДОСТАВЯТ МЕНЬШЕ ХЛОПОТ, А КАК ДЛЯ НАЧИНАЮЩЕГО ПОЛЬЗОВАТЕЛЯ ЭТО ОЧЕНЬ ВАЖНО. СПРОСИТЕ: А КАК НАСЧЕТ ПОДДЕРЖКИ ОПЕРАТИВНОЙ ПАМЯТИ БОЛЕЕ 4ГБ? ОТВЕТ ПРОСТ - НУЖНО ЛИШЬ БУДЕТ ЧЕРЕЗ ГРАФИЧЕСКИЙ МЕНЕДЖЕР ПАКЕТОВ УСТАНОВИТЬ ЯДРО С ИНДЕКСОМ «PAE».\r\n\r\nСКАЧИВАНИЕ\r\n\r\nИТАК, ВЫ ОПРЕДЕЛИЛИСЬ, КАКУЮ ВЕРСИЮ UBUNTU БУДЕТЕ ИСПОЛЬЗОВАТЬ. ПЕРЕХОДИМ ПО ССЫЛКЕ ДЛЯ СКАЧИВАНИЯ UBUNTU, В ПОЛЕ «CHOOSE YOUR FLAVOUR» ВЫБИРАЕМ 32-БИТНУЮ ИЛИ 64-БИТНУЮ ВЕРСИЮ, ЖМЕМ «GET UBUNTU XX.XX». ВОЗМОЖНО ПОСЛЕ ЭТОГО ВАМ БУДЕТ ПРЕДЛОЖЕНО ОТВЕТИТЬ НА ОПРОС, НО СЕЙЧАС НАС ЭТО НЕ ИНТЕРЕСУЕТ, В КОНЦЕ СТРАНИЦЫ НАЖИМАЕМ «NOT NOW, TAKE ME TO THE DOWNLOAD ›»(ПЕРЕВОД «НЕ СЕЙЧАС, ПРИСТУПИТЬ К ЗАГРУЗКЕ >»). ПОСЛЕ ЭТОГО ОТКРОЕТСЯ СТРАНИЦА ЗАГРУЗКИ И ЧЕРЕЗ НЕСКОЛЬКО СЕКУНД НАЧНЕТСЯ ЗАГРУЗКА. ОБРАЗ *.ISO ДИСТРИБУТИВА UBUNTU ЗАНИМАЕТ РАЗМЕР ОКОЛО 700 МБ, ПОЭТОМУ РЕКОМЕНДУЕТСЯ ИСПОЛЬЗОВАТЬ МЕНЕДЖЕР ЗАКАЧКИ, ДЛЯ ТОГО, ЧТО БЫ МОЖНО БЫЛО ДОКАЧАТЬ ОБРАЗ В СЛУЧАЕ РАЗРЫВА СОЕДИНЕНИЯ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '5', 'ustanovka-ubuntu-linux-instruktsiya-dlya-polzovatelya-windows-v-kartinkakh-osnovy', '', '0', NULL, 1, '2019-03-10 21:03:05'),
(6, '2019-03-10 23:15:57', 1, '2019-03-10 23:10:55', 1, 3, NULL, 'Y', NULL, NULL, 500, 'Поиск уязвимостей и вредоносных программ на сайте', 20, '12 бесплатных инструментов для поиска уязвимостей и вредоносных программ на сайте\r\n\r\nОдним из наиболее важных вопросов в области информационных технологий является безопасность. Знаете ли вы, что 96% тестируемых приложений имеют уязвимости?\r\n\r\nНиже приведена диаграмма от Cenzic, на которой показаны различные типы найденных уязвимостей.\r\n\r\nВ этой статье я расскажу о бесплатных инструментах для сканирования сайта на наличие уязвимостей и вредоносных программ.', 'text', 21, '12 бесплатных инструментов для поиска уязвимостей и вредоносных программ на сайте\r\n\r\nОдним из наиболее важных вопросов в области информационных технологий является безопасность. Знаете ли вы, что 96% тестируемых приложений имеют уязвимости?\r\n\r\nНиже приведена диаграмма от Cenzic, на которой показаны различные типы найденных уязвимостей.\r\n\r\nВ этой статье я расскажу о бесплатных инструментах для сканирования сайта на наличие уязвимостей и вредоносных программ.\r\nСписок рассматриваемых инструментов:\r\n\r\nScan My Server;\r\nSUCURI;\r\nQualys SSL Labs, Qualys FreeScan;\r\nQuttera;\r\nDetectify;\r\nSiteGuarding;\r\nWeb Inspector;\r\nAcunetix;\r\nAsafa Web;\r\nNetsparker Cloud;\r\nUpGuard Web Scan;\r\nTinfoil Security.\r\n1. Scan My Server\r\nScanMyServer предоставляет один из самых полных отчетов по тестам безопасности: SQL-инъекциям, межсайтовому скриптингу, инъекциям PHP-кода, раскрытию источника, установке HTTP-заголовков и многое другое.\r\nОтчет о проверке отправляется по электронной почте с кратким описанием найденных уязвимостей.\r\n\r\n2. SUCURI\r\nSUCURI является самым популярным бесплатным сканером вредоносных программ. Вы можете быстро протестировать сайт на наличие вредоносного кода, SPAM-инъекций и его присутствие в различных черных списках.\r\n\r\nSUCURI также очищает и защищает сайт от онлайн-угроз. Инструмент работает на любых CMS, включая WordPress, Joomla, Magento, Drupal, phpBB и т. д.\r\n\r\n3. Qualys SSL Labs, Qualys FreeScan\r\n\r\nSSL Labs является одним из популярных инструментов для сканирования веб-сервера SSL. Он обеспечивает углубленный анализ https URL-адреса, общий рейтинг, шифр, версию SSL / TLS, имитацию рукопожатий, информацию о протоколе, BEAST и многое другое.\r\n\r\nFreeScan проверяет сайты на OWASP Top Risks и вредоносные программы, по параметрам безопасности SCP, а также выполняет другие тесты. Чтобы выполнить сканирование, необходимо зарегистрировать бесплатную учетную запись.\r\n\r\n4. Quttera\r\nQuttera проверяет сайт на наличие вредоносных программ и уязвимостей.\r\n\r\nЭтот инструмент сканирует сайт на наличие вредоносных файлов, подозрительных файлов, потенциально подозрительных файлов, phishTank, а также присутствие в списках безопасного просмотра (Google, Yandex) и списках вредоносных программ.\r\n5. Detectify\r\nDetectify — это сканер сайта, основанный на SaaS. Он позволяет проводить более 100 автоматических тестов безопасности, включая тест OWASP Top 10, наличие вредоносного программного обеспечения и многие другие.', 'text', 'ПОИСК УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ НА САЙТЕ\r\n12 БЕСПЛАТНЫХ ИНСТРУМЕНТОВ ДЛЯ ПОИСКА УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ НА САЙТЕ\r\n\r\nОДНИМ ИЗ НАИБОЛЕЕ ВАЖНЫХ ВОПРОСОВ В ОБЛАСТИ ИНФОРМАЦИОННЫХ ТЕХНОЛОГИЙ ЯВЛЯЕТСЯ БЕЗОПАСНОСТЬ. ЗНАЕТЕ ЛИ ВЫ, ЧТО 96% ТЕСТИРУЕМЫХ ПРИЛОЖЕНИЙ ИМЕЮТ УЯЗВИМОСТИ?\r\n\r\nНИЖЕ ПРИВЕДЕНА ДИАГРАММА ОТ CENZIC, НА КОТОРОЙ ПОКАЗАНЫ РАЗЛИЧНЫЕ ТИПЫ НАЙДЕННЫХ УЯЗВИМОСТЕЙ.\r\n\r\nВ ЭТОЙ СТАТЬЕ Я РАССКАЖУ О БЕСПЛАТНЫХ ИНСТРУМЕНТАХ ДЛЯ СКАНИРОВАНИЯ САЙТА НА НАЛИЧИЕ УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ.\r\n12 БЕСПЛАТНЫХ ИНСТРУМЕНТОВ ДЛЯ ПОИСКА УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ НА САЙТЕ\r\n\r\nОДНИМ ИЗ НАИБОЛЕЕ ВАЖНЫХ ВОПРОСОВ В ОБЛАСТИ ИНФОРМАЦИОННЫХ ТЕХНОЛОГИЙ ЯВЛЯЕТСЯ БЕЗОПАСНОСТЬ. ЗНАЕТЕ ЛИ ВЫ, ЧТО 96% ТЕСТИРУЕМЫХ ПРИЛОЖЕНИЙ ИМЕЮТ УЯЗВИМОСТИ?\r\n\r\nНИЖЕ ПРИВЕДЕНА ДИАГРАММА ОТ CENZIC, НА КОТОРОЙ ПОКАЗАНЫ РАЗЛИЧНЫЕ ТИПЫ НАЙДЕННЫХ УЯЗВИМОСТЕЙ.\r\n\r\nВ ЭТОЙ СТАТЬЕ Я РАССКАЖУ О БЕСПЛАТНЫХ ИНСТРУМЕНТАХ ДЛЯ СКАНИРОВАНИЯ САЙТА НА НАЛИЧИЕ УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ.\r\nСПИСОК РАССМАТРИВАЕМЫХ ИНСТРУМЕНТОВ:\r\n\r\nSCAN MY SERVER;\r\nSUCURI;\r\nQUALYS SSL LABS, QUALYS FREESCAN;\r\nQUTTERA;\r\nDETECTIFY;\r\nSITEGUARDING;\r\nWEB INSPECTOR;\r\nACUNETIX;\r\nASAFA WEB;\r\nNETSPARKER CLOUD;\r\nUPGUARD WEB SCAN;\r\nTINFOIL SECURITY.\r\n1. SCAN MY SERVER\r\nSCANMYSERVER ПРЕДОСТАВЛЯЕТ ОДИН ИЗ САМЫХ ПОЛНЫХ ОТЧЕТОВ ПО ТЕСТАМ БЕЗОПАСНОСТИ: SQL-ИНЪЕКЦИЯМ, МЕЖСАЙТОВОМУ СКРИПТИНГУ, ИНЪЕКЦИЯМ PHP-КОДА, РАСКРЫТИЮ ИСТОЧНИКА, УСТАНОВКЕ HTTP-ЗАГОЛОВКОВ И МНОГОЕ ДРУГОЕ.\r\nОТЧЕТ О ПРОВЕРКЕ ОТПРАВЛЯЕТСЯ ПО ЭЛЕКТРОННОЙ ПОЧТЕ С КРАТКИМ ОПИСАНИЕМ НАЙДЕННЫХ УЯЗВИМОСТЕЙ.\r\n\r\n2. SUCURI\r\nSUCURI ЯВЛЯЕТСЯ САМЫМ ПОПУЛЯРНЫМ БЕСПЛАТНЫМ СКАНЕРОМ ВРЕДОНОСНЫХ ПРОГРАММ. ВЫ МОЖЕТЕ БЫСТРО ПРОТЕСТИРОВАТЬ САЙТ НА НАЛИЧИЕ ВРЕДОНОСНОГО КОДА, SPAM-ИНЪЕКЦИЙ И ЕГО ПРИСУТСТВИЕ В РАЗЛИЧНЫХ ЧЕРНЫХ СПИСКАХ.\r\n\r\nSUCURI ТАКЖЕ ОЧИЩАЕТ И ЗАЩИЩАЕТ САЙТ ОТ ОНЛАЙН-УГРОЗ. ИНСТРУМЕНТ РАБОТАЕТ НА ЛЮБЫХ CMS, ВКЛЮЧАЯ WORDPRESS, JOOMLA, MAGENTO, DRUPAL, PHPBB И Т. Д.\r\n\r\n3. QUALYS SSL LABS, QUALYS FREESCAN\r\n\r\nSSL LABS ЯВЛЯЕТСЯ ОДНИМ ИЗ ПОПУЛЯРНЫХ ИНСТРУМЕНТОВ ДЛЯ СКАНИРОВАНИЯ ВЕБ-СЕРВЕРА SSL. ОН ОБЕСПЕЧИВАЕТ УГЛУБЛЕННЫЙ АНАЛИЗ HTTPS URL-АДРЕСА, ОБЩИЙ РЕЙТИНГ, ШИФР, ВЕРСИЮ SSL / TLS, ИМИТАЦИЮ РУКОПОЖАТИЙ, ИНФОРМАЦИЮ О ПРОТОКОЛЕ, BEAST И МНОГОЕ ДРУГОЕ.\r\n\r\nFREESCAN ПРОВЕРЯЕТ САЙТЫ НА OWASP TOP RISKS И ВРЕДОНОСНЫЕ ПРОГРАММЫ, ПО ПАРАМЕТРАМ БЕЗОПАСНОСТИ SCP, А ТАКЖЕ ВЫПОЛНЯЕТ ДРУГИЕ ТЕСТЫ. ЧТОБЫ ВЫПОЛНИТЬ СКАНИРОВАНИЕ, НЕОБХОДИМО ЗАРЕГИСТРИРОВАТЬ БЕСПЛАТНУЮ УЧЕТНУЮ ЗАПИСЬ.\r\n\r\n4. QUTTERA\r\nQUTTERA ПРОВЕРЯЕТ САЙТ НА НАЛИЧИЕ ВРЕДОНОСНЫХ ПРОГРАММ И УЯЗВИМОСТЕЙ.\r\n\r\nЭТОТ ИНСТРУМЕНТ СКАНИРУЕТ САЙТ НА НАЛИЧИЕ ВРЕДОНОСНЫХ ФАЙЛОВ, ПОДОЗРИТЕЛЬНЫХ ФАЙЛОВ, ПОТЕНЦИАЛЬНО ПОДОЗРИТЕЛЬНЫХ ФАЙЛОВ, PHISHTANK, А ТАКЖЕ ПРИСУТСТВИЕ В СПИСКАХ БЕЗОПАСНОГО ПРОСМОТРА (GOOGLE, YANDEX) И СПИСКАХ ВРЕДОНОСНЫХ ПРОГРАММ.\r\n5. DETECTIFY\r\nDETECTIFY — ЭТО СКАНЕР САЙТА, ОСНОВАННЫЙ НА SAAS. ОН ПОЗВОЛЯЕТ ПРОВОДИТЬ БОЛЕЕ 100 АВТОМАТИЧЕСКИХ ТЕСТОВ БЕЗОПАСНОСТИ, ВКЛЮЧАЯ ТЕСТ OWASP TOP 10, НАЛИЧИЕ ВРЕДОНОСНОГО ПРОГРАММНОГО ОБЕСПЕЧЕНИЯ И МНОГИЕ ДРУГИЕ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '6', '', '', '0', NULL, 1, '2019-03-10 23:11:00');

