(10, 'e080d23ee15f53211cc70621f7149bc5', 'ЗАГАДОЧНАЯ «ОБЛАСТЬ МОЗГА» НА ПОВЕРХНОСТИ МАРСА\r\nКОСМИЧЕСКОЕ АГЕНСТВО NASA ЧАСТО ДЕЛИТСЯ ФОТОГРАФИЯМИ МАРСА, НО НЕДАВНО ОНО ОПУБЛИКОВАЛО НЕ ПРИВЫЧНЫЙ ПЕЙЗАЖ С КРАСНОЙ И ПЫЛЬНОЙ ПОВЕРХНОСТЬЮ, А СНИМОК ЗАГАДОЧНОЙ ТЕРРИТОРИИ ПОД НАЗВАНИЕМ «ОБЛАСТЬ МОЗГА». ОНА ПОЛУЧИЛА ТАКОЕ НАЗВАНИЕ ИЗ-ЗА ТЕКСТУРЫ И ЦВЕТА, КОТОРЫЕ ОТДАЛЕННО НАПОМИНАЮТ ИЗВИЛИНЫ ЧЕЛОВЕЧЕСКОГО МОЗГА. ИССЛЕДОВАТЕЛИ НЕ ЗНАЮТ, ЧТО СТАЛО ПРИЧИНОЙ ОБРАЗОВАНИЯ ТАКОЙ ПОВЕРХНОСТИ, НО У НИХ ЕСТЬ ПРЕДПОЛОЖЕНИЕ, КОТОРОЕ СВЯЗАНО С ВОЗМОЖНЫМ НАЛИЧИЕМ НА МАРСЕ ВОДЫ.\r\nКОСМИЧЕСКОЕ АГЕНСТВО NASA ЧАСТО ДЕЛИТСЯ ФОТОГРАФИЯМИ МАРСА, НО НЕДАВНО ОНО ОПУБЛИКОВАЛО НЕ ПРИВЫЧНЫЙ ПЕЙЗАЖ С КРАСНОЙ И ПЫЛЬНОЙ ПОВЕРХНОСТЬЮ, А СНИМОК ЗАГАДОЧНОЙ ТЕРРИТОРИИ ПОД НАЗВАНИЕМ «ОБЛАСТЬ МОЗГА». ОНА ПОЛУЧИЛА ТАКОЕ НАЗВАНИЕ ИЗ-ЗА ТЕКСТУРЫ И ЦВЕТА, КОТОРЫЕ ОТДАЛЕННО НАПОМИНАЮТ ИЗВИЛИНЫ ЧЕЛОВЕЧЕСКОГО МОЗГА. ИССЛЕДОВАТЕЛИ НЕ ЗНАЮТ, ЧТО СТАЛО ПРИЧИНОЙ ОБРАЗОВАНИЯ ТАКОЙ ПОВЕРХНОСТИ, НО У НИХ ЕСТЬ ПРЕДПОЛОЖЕНИЕ, КОТОРОЕ СВЯЗАНО С ВОЗМОЖНЫМ НАЛИЧИЕМ НА МАРСЕ ВОДЫ.\r\n\r\nНЕОБЫЧНАЯ ТЕКСТУРА ОБРАЗОВАНА НА ТЕРРИТОРИИ ПОД НАЗВАНИЕМ ПРОТОНИЛУС МЕНСА, ПОД ПОВЕРХНОСТЬЮ КОТОРОЙ МОЖЕТ ПРИСУТСТВОВАТЬ ОБЛЕДЕНЕЛАЯ ВОДА. ИМЕННО ОНА, ПО МНЕНИЮ ИССЛЕДОВАТЕЛЕЙ И ЯВЛЯЕТСЯ ПРИЧИНОЙ ОБРАЗОВАНИЯ НЕРОВНОСТЕЙ. СКОРЕЕ ВСЕГО, ВПАДИНЫ ВОЗНИКАЮТ В ПРОЦЕССЕ ПРЕВРАЩЕНИЯ ТВЕРДОГО ЛЬДА В ПАР. ИССЛЕДОВАТЕЛИ УВЕРЕНЫ, ЧТО ТАКУЮ ПОВЕРХНОСТЬ МОЖНО ВСТРЕТИТЬ И В ДРУГИХ ОБЛАСТЯХ СРЕДНИХ ШИРОТ КРАСНОЙ ПЛАНЕТЫ.\r\n\r\nСНИМОК БЫЛ СДЕЛАН ПРИ ПОМОЩИ МЕЖПЛАНЕТНОЙ СТАНЦИИ MARS RECONNAISSANCE ORBITER (MRO), КОТОРЫЙ НАЧАЛ ФУНКЦИОНИРОВАТЬ В ДАЛЕКОМ 2006 ГОДУ. В КАЧЕСТВЕ КАМЕРЫ ИСПОЛЬЗОВАЛАСЬ СИСТЕМА HIRISE, КОТОРАЯ ЗА ПОСЛЕДНЕЕ ДЕСЯТИЛЕТИЕ СДЕЛАЛА БОЛЕЕ 52000 ВЫСОКОКАЧЕСТВЕННЫХ СНИМКОВ КРАСНОЙ ПЛАНЕТЫ. НАПРИМЕР, В КОНЦЕ 2018 ГОДА ПОД ЕГО ВЗОР ПОПАЛ КОСМИЧЕСКИЙ ЗОНД INSIGHT.\r\n\r\nЕСТЬ МНЕНИЕ, ЧТО ПРОЦЕСС ФОРМИРОВАНИЯ ТЕКСТУРЫ ИДЕТ НЕПРЕРЫВНО, ОДНАКО ИССЛЕДОВАТЕЛЯМ ПОКА НЕ УДАЛОСЬ ЗАФИКСИРОВАТЬ КАКИХ-ЛИБО ИЗМЕНЕНИЙ. ВОЗМОЖНО, В СКОРОМ БУДУЩЕМ КАМЕРАМ УДАСТСЯ ЗАСНЯТЬ ИЗМЕНЕНИЯ, И NASA СТАНЕТ БЛИЖЕ К РАСКРЫТИЮ ТАЙНЫ ОБРАЗОВАНИЯ СТРАННОЙ «ОБЛАСТИ МОЗГА».\r\n\r\nКАК ВЫ СЧИТАЕТЕ, ИЗ-ЗА ЧЕГО ВОЗНИКЛИ ТАКИЕ НЕРОВНОСТИ? СВОИ СМЕЛЫЕ ПРЕДПОЛОЖЕНИЯ МОЖЕТЕ НАПИСАТЬ В КОММЕНТАРИЯХ, А ОБСУДИТЬ ТЕМУ ПОДРОБНЕЕ МОЖНО В НАШЕМ TELEGRAM-ЧАТЕ.\r\n'),
(11, '450b3b1c9dc76512f916ce58c49ee55b', 'ОБНАРУЖЕННЫЙ «ДВОЙНИК» ЗЕМЛИ ЗАИНТЕРЕСОВАЛ АСТРОНОМОВ\r\nЯПОНСКИЕ АСТРОНОМЫ ПРОАНАЛИЗИРОВАЛИ ДАННЫЕ С КОСМИЧЕСКОГО ТЕЛЕСКОПА «КЕПЛЕР» И ОБНАРУЖИЛИ 15 НОВЫХ ЭКЗОПЛАНЕТ. ПРИ ЭТОМ ОДНА ИЗ НИХ, КАК ГОВОРЯТ УЧЕНЫЕ, КАК ДВЕ КАПЛИ ВОДЫ ПОХОЖА НА НАШУ ЗЕМЛЮ. ЕДИНСТВЕННОЕ, ЧТО ИХ ОТЛИЧАЕТ, ТАК ЭТО РАЗМЕР. ОБНАРУЖЕННАЯ ПЛАНЕТА, ПОЛУЧИВШАЯ ИНДЕКС K2-155D, В ДВА РАЗА БОЛЬШЕ НАШЕГО РОДНОГО МИРА. В ТО ЖЕ ВРЕМЯ ПЛАНЕТА НАХОДИТСЯ В «ОБИТАЕМОЙ ЗОНЕ» ЗВЕЗДЫ И ПРЕДПОЛОЖИТЕЛЬНО ОБЛАДАЕТ ОКЕАНАМИ И ЗЕМНОЙ АТМОСФЕРОЙ, ГОВОРИТСЯ В СТАТЬЕ, ОПУБЛИКОВАННОЙ В ASTRONOMICAL JOURNAL.\r\nЯПОНСКИЕ АСТРОНОМЫ ПРОАНАЛИЗИРОВАЛИ ДАННЫЕ С КОСМИЧЕСКОГО ТЕЛЕСКОПА «КЕПЛЕР» И ОБНАРУЖИЛИ 15 НОВЫХ ЭКЗОПЛАНЕТ. ПРИ ЭТОМ ОДНА ИЗ НИХ, КАК ГОВОРЯТ УЧЕНЫЕ, КАК ДВЕ КАПЛИ ВОДЫ ПОХОЖА НА НАШУ ЗЕМЛЮ. ЕДИНСТВЕННОЕ, ЧТО ИХ ОТЛИЧАЕТ, ТАК ЭТО РАЗМЕР. ОБНАРУЖЕННАЯ ПЛАНЕТА, ПОЛУЧИВШАЯ ИНДЕКС K2-155D, В ДВА РАЗА БОЛЬШЕ НАШЕГО РОДНОГО МИРА. В ТО ЖЕ ВРЕМЯ ПЛАНЕТА НАХОДИТСЯ В «ОБИТАЕМОЙ ЗОНЕ» ЗВЕЗДЫ И ПРЕДПОЛОЖИТЕЛЬНО ОБЛАДАЕТ ОКЕАНАМИ И ЗЕМНОЙ АТМОСФЕРОЙ, ГОВОРИТСЯ В СТАТЬЕ, ОПУБЛИКОВАННОЙ В ASTRONOMICAL JOURNAL.\r\n\r\n«НАШИ РАСЧЕТЫ ПОКАЗЫВАЮТ, ЧТО У ЭТОЙ ПЛАНЕТЫ ДОЛЖНА БЫТЬ ЗЕМНАЯ АТМОСФЕРА И АНАЛОГИЧНАЯ СТРУКТУРА НЕДР, ОДНАКО ПОДТВЕРДИТЬ ЭТО МЫ ПОКА НЕ МОЖЕМ. МЫ МАЛО ЗНАЕМ О ПЛАНЕТАХ, ВРАЩАЮЩИХСЯ ВОКРУГ КРАСНЫХ КАРЛИКОВ, ТАК КАК ЧИСЛО ЭТИХ ЗВЕЗД ЗАМЕТНО НИЖЕ, ЧЕМ ОБЩЕЕ КОЛИЧЕСТВО ПЛАНЕТ, ОТКРЫТЫХ У ЗВЕЗД, ПОХОЖИХ НА СОЛНЦЕ», — ПРОКОММЕНТИРОВАЛ ТЕРУЮКИ ХИРАНО ИЗ ТЕХНОЛОГИЧЕСКОГО ИНСТИТУТА ТОКИО.\r\n\r\nБЛАГОДАРЯ КОСМИЧЕСКОМУ ТЕЛЕСКОПУ «КЕПЛЕР» К НАСТОЯЩЕМУ МОМЕНТУ АСТРОНОМЫ ОБНАРУЖИЛИ ПОЧТИ ЧЕТЫРЕ ТЫСЯЧИ ЭКЗОПЛАНЕТ САМОЙ РАЗНОЙ КАТЕГОРИИ. НЕСКОЛЬКО ДЕСЯТКОВ ИЗ ЭТИХ МИРОВ ЯВЛЯЮТСЯ ПОТЕНЦИАЛЬНЫМИ «ДВОЙНИКАМИ» ЗЕМЛИ ИЛИ НАХОДЯТСЯ В ТАК НАЗЫВАЕМОЙ «ОБИТАЕМОЙ ЗОНЕ» СВОИХ СВЕТИЛ. ИХ ОТКРЫТИЕ ПОБУДИЛО ПЛАНЕТОЛОГОВ И АСТРОБИОЛОГОВ ПРИСТУПИТЬ К РАЗРАБОТКЕ МЕТОДОВ, КОТОРЫЕ БЫ ПОЗВОЛИЛИ ОЦЕНИТЬ ПРИГОДНОСТЬ К ЖИЗНИ ИЛИ ЖЕ ПОПЫТАТЬСЯ НАЙТИ ЕЕ СЛЕДЫ В ИХ АТМОСФЕРЕ.\r\n\r\nВ МАЕ 2013 ГОДА ТЕЛЕСКОП ВЫШЕЛ ИЗ СТРОЯ, ОДНАКО СПЕЦИАЛИСТЫ НАШЛИ СПОСОБ ПРОДОЛЖИТЬ РАБОТУ В РАМКАХ ТАК НАЗЫВАЕМОЙ МИССИИ K2. ДО ПОЛОМКИ «КЕПЛЕР» СЛЕДИЛ ЛИШЬ ЗА НЕБОЛЬШИМ УЧАСТКОМ КОСМОСА, РАСПОЛОЖЕННОМ НА СТЫКЕ СОЗВЕЗДИЙ ЛЕБЕДЯ И ЛИРЫ. ПОСЛЕ ВОЗВРАЩЕНИЯ В СТРОЙ ТЕЛЕСКОП НАБЛЮДАЕТ ЗА РАЗНЫМИ УЧАСТКАМИ НЕБОСВОДА, ТАК КАК СПЕЦИАЛИСТАМ NASA ПРИХОДИТСЯ ПОСТОЯННО ПОВОРАЧИВАТЬ ЕГО ТАКИМ ОБРАЗОМ, ЧТОБЫ СОЛНЕЧНЫЙ СВЕТ НЕ ПОПАДАЛ В ОБЪЕКТИВ. НЕСМОТРЯ НА ЭТО, В РАМКАХ МИССИИ K2 «КЕПЛЕР» УЖЕ УСПЕЛ ОБНАРУЖИТЬ МНОЖЕСТВО НОВЫХ ПЛАНЕТ. ЧТО КАСАЕТСЯ ХИРАНО И ЕГО КОМАНДЫ, ТО ИХ РАБОТА БЫЛА НАПРАВЛЕНА НА АНАЛИЗ ДАННЫХ, СОБРАННЫХ ТЕЛЕСКОПОМ В ПЕРВЫЕ ТРИ ГОДА ПОСЛЕ «ВОСКРЕШЕНИЯ».\r\n\r\nИССЛЕДОВАТЕЛИ ОТМЕЧАЮТ, ЧТО ИХ ИНТЕРЕСОВАЛИ НЕБЕСНЫЕ ТЕЛА, ВРАЩАЮЩИЕСЯ ВОКРУГ НЕ СОЛНЦЕПОДОБНЫХ ЗВЕЗД, А КРАСНЫХ КАРЛИКОВ — НЕБОЛЬШИХ И ТУСКЛЫХ ЗВЕЗД, ЖИВУЩИХ ОЧЕНЬ ДОЛГО ПО СРАВНЕНИЮ С ДРУГИМИ ТИПАМИ СВЕТИЛ И ОТЛИЧАЮЩИХСЯ СПОКОЙНЫМ ХАРАКТЕРОМ (ПРАВДА, КАК ОКАЗАЛОСЬ, И ОНИ МОГУТ ПРЕПОДНОСИТЬ СЮРПРИЗЫ). ЗА ПОСЛЕДНИЕ ДВА ГОДА АСТРОНОМЫ ОТКРЫЛИ СРАЗУ НЕСКОЛЬКО ЗВЕЗДНЫХ СИСТЕМ И ЭКЗОПЛАНЕТ. В ИХ ЧИСЛО ТАКЖЕ ВХОДИТ ПРОКСИМА B И СЕМЬ НЕБОЛЬШИХ МИРОВ У ЗВЕЗДЫ TRAPPIST-1. НОВЫЕ СИСТЕМЫ НАВЕЛИ АСТРОНОМОВ НА МЫСЛЬ, ЧТО ПЕРВЫЙ ПОЛНОЦЕННЫЙ АНАЛОГ ЗЕМЛИ БУДЕТ ОТКРЫТ У КРАСНОГО КАРЛИКА, А НЕ РЯДОМ С ДВОЙНИКОМ СОЛНЦА.\r\n\r\nХИРАНО ГОВОРИТ, ЧТО «КЕПЛЕР» ИЗНАЧАЛЬНО БЫЛ ПРЕДНАЗНАЧЕН ДЛЯ ПОИСКА ПЛАНЕТ У БОЛЕЕ ЯРКИХ И КРУПНЫХ СВЕТИЛ, ЧТО ОСЛОЖНИЛО ПОИСКИ У ТУСКЛЫХ КРАСНЫХ КАРЛИКОВ, ЧЬЯ ЯРКОСТЬ ПОЧТИ НЕ МЕНЯЕТСЯ В ТОТ МОМЕНТ, КОГДА ИХ СПУТНИКИ ПРОХОДЯТ ПО ДИСКУ СВЕТИЛА, СНИЖАЯ ЕГО СВЕТИМОСТЬ.\r\n\r\nОБЪЕДИНЕНИЕ ДАННЫХ, СОБРАННЫХ «КЕПЛЕРОМ» И НАЗЕМНЫМИ ОБСЕРВАТОРИЯМИ, РАБОТАЮЩИМИ В ИНФРАКРАСНОМ И ОПТИЧЕСКОМ ДИАПАЗОНАХ, ПОЗВОЛИЛО РЕШИТЬ ПРОБЛЕМУ НАБЛЮДЕНИЯ. УЧЕНЫЕ ТЕПЕРЬ МОГЛИ ОПРЕДЕЛЯТЬ, КАКИЕ ПОНИЖЕНИЯ В ЯРКОСТИ БЫЛИ ВЫЗВАНЫ ПЛАНЕТАМИ, А КАКИЕ — ПРОЦЕССАМИ, ПРОИСХОДЯЩИМИ ВНУТРИ САМИХ ЗВЕЗД.\r\n\r\nВ ИТОГЕ ЯПОНСКИЕ АСТРОНОМЫ НАШЛИ СРАЗУ 15 НОВЫХ НЕБЕСНЫХ ТЕЛ, ПОХОЖИХ ПО РАЗМЕРАМ НА УВЕЛИЧЕННЫЕ КОПИИ ЗЕМЛИ. ВСЕ ОНИ ВРАЩАЮТСЯ ВОКРУГ СВОИХ СВЕТИЛ НА ОЧЕНЬ НЕБОЛЬШОМ РАССТОЯНИИ — ГОД НА ИХ ПОВЕРХНОСТИ ДЛИТСЯ ОТ ОДНОГО ДО 40 ДНЕЙ. ПО МНЕНИЮ УЧЕНЫХ, ПРАКТИЧЕСКИ ВСЕ ОТКРЫТЫЕ ПЛАНЕТЫ ВРЯД ЛИ СПОСОБНЫ ПОДДЕРЖИВАТЬ ЖИЗНЬ. ТЕМПЕРАТУРОЙ И КЛИМАТОМ ОНИ ДОЛЖНЫ СКОРЕЕ НАПОМИНАТЬ ВЕНЕРУ.\r\n\r\nЕДИНСТВЕННОЕ ИСКЛЮЧЕНИЕ ИЗ СПИСКА — СИСТЕМА K2-155. ОНА РАСПОЛОЖЕНА В СОЗВЕЗДИИ ТЕЛЬЦА И НАХОДИТСЯ ПРИМЕРНО В 200 СВЕТОВЫХ ГОДАХ ОТ ЗЕМЛИ. В НЕЙ ИМЕЕТСЯ СРАЗУ ТРИ «СУПЕРЗЕМЛИ», САМАЯ ДАЛЕКАЯ ИЗ КОТОРЫХ, K2-155D, РАСПОЛОЖИЛАСЬ В ЦЕНТРАЛЬНОЙ ЧАСТИ «ОБИТАЕМОЙ ЗОНЫ» И, КАК СЧИТАЮТ ПЛАНЕТОЛОГИ, ДОЛЖНА БЫТЬ ПОХОЖА ПО СВОЕМУ КЛИМАТУ И ГИДРОЛОГИЧЕСКИМ УСЛОВИЯМ НА ЗЕМЛЮ.\r\n\r\nПРОВЕРИТЬ ВСЕ ЭТИ ПРЕДПОЛОЖЕНИЯ, ПО СЛОВАМ ХИРАНО, МОЖНО БУДЕТ В САМОМ БЛИЖАЙШЕМ БУДУЩЕМ. В КОНЦЕ ГОДА NASA ПЛАНИРУЕТ ЗАПУСТИТЬ НА ОРБИТУ ТЕЛЕСКОП TESS, КОТОРЫЙ СТАНЕТ НАСЛЕДНИКОМ «КЕПЛЕРА». АППАРАТ СМОЖЕТ ПОЛУЧИТЬ ПЕРВЫЕ ТОЧНЫЕ ДАННЫЕ ПО СОСТАВУ И ТЕМПЕРАТУРАМ ЭТИХ ПЛАНЕТ И ПРОВЕРИТ, ДЕЙСТВИТЕЛЬНО ЛИ РЕЧЬ ИДЕТ О ПОЛНОЦЕННОЙ «БОЛЬШОЙ СЕСТРЕ» ЗЕМЛИ.\r\n'),
(12, '799d84e228625d4d467b94ace4650861', 'В АЛЬПАХ НАШЛИ ПРЕДКА ТИРАННОЗАВРОВ. И ОН ПРОЛИЛ СВЕТ НА ЭВОЛЮЦИЮ ДРЕВНИХ ЯЩЕРОВ\r\nСЧИТАЕТСЯ, ЧТО КРУПНЫЕ ДИНОЗАВРЫ ПОЯВИЛИСЬ В СЕРЕДИНЕ ЮРСКОГО ПЕРИОДА, ОКОЛО 180 МИЛЛИОНОВ ЛЕТ НАЗАД, А ДО ЭТОГО ПО ДРЕВНЕЙ ЗЕМЛЕ РАЗГУЛИВАЛИ ЯЩЕРЫ КУДА МЕНЬШИХ РАЗМЕРОВ. ОДНАКО НЕДАВНЕЕ ОТКРЫТИЕ ПАЛЕОНТОЛОГОВ МОЖЕТ В КОРНЕ ИЗМЕНИТЬ ПРЕДСТАВЛЕНИЕ ОБ ЭТОМ ВРЕМЕННОМ ПЕРИОДЕ. НЕ ТАК ДАВНО НА ТЕРРИТОРИИ АЛЬПОВ ОБНАРУЖИЛИ ОСТАНКИ НЕИЗВЕСТНОГО ДРЕВНЕГО ЯЩЕРА, КОТОРЫЙ НЕ ПРОСТО ЖИЛ ЗАДОЛГО ДО КРУПНЫХ ДИНОЗАВРОВ, НО И ПО РАЗМЕРАМ НИЧЕМ ИМ НЕ УСТУПАЛ.\r\nСЧИТАЕТСЯ, ЧТО КРУПНЫЕ ДИНОЗАВРЫ ПОЯВИЛИСЬ В СЕРЕДИНЕ ЮРСКОГО ПЕРИОДА, ОКОЛО 180 МИЛЛИОНОВ ЛЕТ НАЗАД, А ДО ЭТОГО ПО ДРЕВНЕЙ ЗЕМЛЕ РАЗГУЛИВАЛИ ЯЩЕРЫ КУДА МЕНЬШИХ РАЗМЕРОВ. ОДНАКО НЕДАВНЕЕ ОТКРЫТИЕ ПАЛЕОНТОЛОГОВ МОЖЕТ В КОРНЕ ИЗМЕНИТЬ ПРЕДСТАВЛЕНИЕ ОБ ЭТОМ ВРЕМЕННОМ ПЕРИОДЕ. НЕ ТАК ДАВНО НА ТЕРРИТОРИИ АЛЬПОВ ОБНАРУЖИЛИ ОСТАНКИ НЕИЗВЕСТНОГО ДРЕВНЕГО ЯЩЕРА, КОТОРЫЙ НЕ ПРОСТО ЖИЛ ЗАДОЛГО ДО КРУПНЫХ ДИНОЗАВРОВ, НО И ПО РАЗМЕРАМ НИЧЕМ ИМ НЕ УСТУПАЛ.\rКАК СООБЩАЕТ РЕДАКЦИЯ ЖУРНАЛА PEERJ, НОВЫЙ ЯЩЕР ПОЛУЧИЛ ИМЯ SALTRIOVENATOR ZANELLAI И ОБИТАЛ ОН НА ТЕРРИТОРИИ СОВРЕМЕННОЙ ИТАЛИИ ОКОЛО 200 МИЛЛИОНОВ ЛЕТ НАЗАД. ОТКРЫТИЕ СОВЕРШИЛА ГРУППА УЧЕНЫХ ВО ГЛАВЕ С АНДЖЕЛО ЗАНЕЛЛОЙ. ВСЕГО БЫЛО НАЙДЕНО 132 КОСТИ ДРЕВНЕГО ЯЩЕРА. УТВЕРЖДАЕТСЯ, ЧТО ВОЗРАСТ ДИНОЗАВРА СОСТАВЛЯЕТ ОКОЛО 24 ЛЕТ, ЧТО ДОВОЛЬНО НЕБОЛЬШОЙ СРОК ДЛЯ ДИНОЗАВРОВ ПОДОБНЫХ РАЗМЕРОВ. ВЕС SALTRIOVENATOR ZANELLAI, СОГЛАСНО РАСЧЕТАМ ЭКСПЕРТОВ, СОСТАВЛЯЕТ ПОРЯДКА 1,3 ТОНН, А РОСТ 3 МЕТРА. ДИНОЗАВР ХОДИЛ НА ЧЕТЫРЕХ ЛАПАХ И ДЛИНА ЕГО ТУЛОВИЩА ТАКЖЕ РАВНЯЕТСЯ 3 МЕТРАМ.\rА ВОТ НА САМИХ ЛАПАХ СТОИТ ОСТАНОВИТЬСЯ ПОДРОБНЕЕ. ДЕЛО В ТОМ, ЧТО БОЛЕЕ ДРЕВНИХ ЯЩЕРОВ НА ЛАПАХ ИМЕЕТСЯ 5 ПАЛЬЦЕВ. В ХОДЕ ЭВОЛЮЦИОННЫХ ИЗМЕНЕНИИ ОДИН ИЗ НИХ БЫЛ УТЕРЯН. ПРИ ЭТОМ У ИЗВЕСТНЫХ НАМ ОБИТАТЕЛЯХ СЕРЕДИНЫ ЮРСКОГО ПЕРИОДА НА ЛАПАХ УЖЕ ПО 3 ПАЛЬЦА. А ВОТ У НАЙДЕННОГО SALTRIOVENATOR ZANELLAI КОЛИЧЕСТВО ПАЛЬЦЕВ РАВНЯЕТСЯ 4, ЧТО ПОЗВОЛЯЕТ ПРЕДПОЛОЖИТЬ, ЧТО ОН ЯВЛЯЕТСЯ СВОЕГО РОДА ПРОМЕЖУТОЧНЫМ ЗВЕНОМ МЕЖДУ ДРЕВНИМИ ЯЩЕРАМИ И ИХ БОЛЕЕ СОВРЕМЕННЫМИ ПОТОМКАМИ.\rПРИ ЭТОМ ПАЛЬЦЫ ДИНОЗАВРА МОГУТ ПРОЛИТЬ СВЕТ ЕЩЕ И НА ТОТ МОМЕНТ, КАКОЙ КОНКРЕТНО ПАЛЕЦ ПОТЕРЯЛИ ОБИТАТЕЛИ ЮРСКОГО ПЕРИОДА В ХОДЕ СВОЕЙ ЭВОЛЮЦИИ. ВЫРАЖАЯСЬ СОВРЕМЕННЫМ ЯЗЫКОМ, ПЯТИПАЛЫЕ ЯЩЕРЫ ЛИШИЛИСЬ «МИЗИНЦА», А СОРОДИЧИ ТИРАНОЗАВРОВ УЖЕ БЫЛИ БЕЗ «БЕЗЫМЯННОГО» ПАЛЬЦА. РАНЕЕ СЧИТАЛОСЬ, ЧТО ВТОРЫМ УТРАЧЕННЫМ ПАЛЬЦЕМ, СКОРЕЕ ВСЕГО, ЯВЛЯЕТСЯ «БОЛЬШОЙ».\r\n'),
(13, '3824ecf9f8dc50a0b24ed1b3685ef2c2', 'СБОРКА КОМПЬЮТЕРОВ НА ЗАКАЗ\r\nКОМПАНИЯ ОСНОВАНА В 2009 ГОДУ И ЯВЛЯЕТСЯ ОФИЦИАЛЬНЫМ ПАРТНЕРОМ ТАКИХ ИЗВЕСТНЫХ ТЕХНОЛОГИЧЕСКИХ КОМПАНИЙ КАК: NVIDIA, INTEL, ASUS, MSI, COOLER MASTER, CORSAIR И МНОГИХ ДРУГИХ. ТАКЖЕ МЫ РЕАЛИЗОВАЛИ НЕ ОДИН СОВМЕСТНЫЙ ПРОЕКТ С ТАКИМИ РАЗРАБОТЧИКАМИ ИГР, КАК: WARGAMING, UBISOFT, ELECTRONIC ARTS, BETHESDA, MAIL.GAMES.\r\nКОМПАНИЯ ОСНОВАНА В 2009 ГОДУ И ЯВЛЯЕТСЯ ОФИЦИАЛЬНЫМ ПАРТНЕРОМ ТАКИХ ИЗВЕСТНЫХ ТЕХНОЛОГИЧЕСКИХ КОМПАНИЙ КАК: NVIDIA, INTEL, ASUS, MSI, COOLER MASTER, CORSAIR И МНОГИХ ДРУГИХ. ТАКЖЕ МЫ РЕАЛИЗОВАЛИ НЕ ОДИН СОВМЕСТНЫЙ ПРОЕКТ С ТАКИМИ РАЗРАБОТЧИКАМИ ИГР, КАК: WARGAMING, UBISOFT, ELECTRONIC ARTS, BETHESDA, MAIL.GAMES.\r\n\r\nГЛАВНЫЙ ОФИС КОМПАНИИ, ШОУРУМ И СБОРКА НАХОДЯТСЯ В МОСКВЕ. МЫ ОСУЩЕСТВЛЯЕМ ДОСТАВКУ КОМПЬЮТЕРОВ ПО ВСЕЙ РОССИИ И МИРУ. НАША КОМПАНИЯ РАБОТАЕТ КАК С ЧАСТНЫМИ ЛИЦАМИ, ТАК И С ЮРИДИЧЕСКИМИ ЛИЦАМИ.\r\n'),
(14, 'f5a729faed9af9e500e5aa32bc310c19', 'УСТАНОВКА UBUNTU LINUX: ИНСТРУКЦИЯ ДЛЯ ПОЛЬЗОВАТЕЛЯ WINDOWS (В КАРТИНКАХ, ОСНОВЫ)\r\nДАННАЯ СТАТЬЯ ПРЕДНАЗНАЧЕНА ДЛЯ ТЕХ ПОЛЬЗОВАТЕЛЕЙ, КТО ХОРОШО ВЛАДЕЕТ КОМПЬЮТЕРАМИ ВООБЩЕ И ИМЕЕТ БОЛЬШОЙ ОПЫТ РАБОТЫ С WINDOWS В ЧАСТНОСТИ, НО ПЛОХО ЗНАЕТ (ИЛИ ВООБЩЕ НЕ ЗНАЕТ) LINUX. ИМЕННО ПОЭТОМУ В ЭТОЙ СТАТЬЕ НЕ БУДЕТ УПОТРЕБЛЯТЬСЯ ЛЕКСИКА, СПЕЦИФИЧЕСКАЯ ДЛЯ UNIX. ОБЫЧНЫЕ ДЛЯ LINUX ЗАДАЧИ, ТАКИЕ КАК РАЗБИЕНИЕ ЖЁСТКОГО ДИСКА НА РАЗДЕЛЫ, УСТАНОВКА ПРОГРАММНОГО ОБЕСПЕЧЕНИЯ И ПОДКЛЮЧЕНИЕ НЕОБХОДИМЫХ ПЛАГИНОВ, БУДУТ ПОЛНОСТЬЮ РЕШЕНЫ С ПОМОЩЬЮ ГРАФИЧЕСКОГО ПОЛЬЗОВАТЕЛЬСКОГО ИНТЕРФЕЙСА (GUI).\r\n\r\nДАННАЯ СТАТЬЯ ПРЕДНАЗНАЧЕНА ДЛЯ ТЕХ ПОЛЬЗОВАТЕЛЕЙ, КТО ХОРОШО ВЛАДЕЕТ КОМПЬЮТЕРАМИ ВООБЩЕ И ИМЕЕТ БОЛЬШОЙ ОПЫТ РАБОТЫ С WINDOWS В ЧАСТНОСТИ, НО ПЛОХО ЗНАЕТ (ИЛИ ВООБЩЕ НЕ ЗНАЕТ) LINUX. ИМЕННО ПОЭТОМУ В ЭТОЙ СТАТЬЕ НЕ БУДЕТ УПОТРЕБЛЯТЬСЯ ЛЕКСИКА, СПЕЦИФИЧЕСКАЯ ДЛЯ UNIX. ОБЫЧНЫЕ ДЛЯ LINUX ЗАДАЧИ, ТАКИЕ КАК РАЗБИЕНИЕ ЖЁСТКОГО ДИСКА НА РАЗДЕЛЫ, УСТАНОВКА ПРОГРАММНОГО ОБЕСПЕЧЕНИЯ И ПОДКЛЮЧЕНИЕ НЕОБХОДИМЫХ ПЛАГИНОВ, БУДУТ ПОЛНОСТЬЮ РЕШЕНЫ С ПОМОЩЬЮ ГРАФИЧЕСКОГО ПОЛЬЗОВАТЕЛЬСКОГО ИНТЕРФЕЙСА (GUI).\r\n\r\nПОДГОТОВКА\r\nАППАРАТНОЕ ОБЕСПЕЧЕНИЕ\r\n\r\nОДНИМ ИЗ САМЫХ ПРИВЛЕКАТЕЛЬНЫХ КАЧЕСТВ LINUX ЯВЛЯЕТСЯ ОТНОСИТЕЛЬНО НИЗКИЙ УРОВЕНЬ ТЕХНИЧЕСКИХ ТРЕБОВАНИЙ ДАЖЕ К САМЫМ СОВРЕМЕННЫМ СИСТЕМАМ. МИНИМАЛЬНЫЕ СИСТЕМНЫЕ ТРЕБОВАНИЯ UBUNTU - ЭТО 512 МБАЙТ ОПЕРАТИВНОЙ ПАМЯТИ И 5 ГБАЙТ ДИСКОВОГО ПРОСТРАНСТВА. ПОЭТОМУ UBUNTU ИДЕАЛЬНО ПОДХОДИТ ДЛЯ ИСПОЛЬЗОВАНИЯ В НЕТБУКАХ, КОТОРЫЕ НЕ БЛЕЩУТ СВОЕЙ ПРОИЗВОДИТЕЛЬНОСТЬЮ В WINDOWS.\r\n\r\nКАКУЮ ВЕРСИЮ ВЫБРАТЬ?\r\n\r\nДЛЯ НАЧАЛА ВАМ НУЖНО СКАЧАТЬ ISO-ФАЙЛ C ОФИЦИАЛЬНОГО WEB-САЙТА UBUNTU. ПРЕЖДЕ ВСЕГО, ВАС ПОПРОСЯТ ВЫБРАТЬ МЕЖДУ ОБЫЧНОЙ ВЕРСИЕЙ И LTS. НОВАЯ ВЕРСИЯ UBUNTU ПОЯВЛЯЕТСЯ КАЖДЫЕ ШЕСТЬ МЕСЯЦЕВ, А LTS-РЕЛИЗ ВЫХОДИТ РАЗ В ДВА ГОДА. UBUNTU С ИНДЕКСОМ LTS ПОДДЕРЖИВАЕТСЯ В ТЕЧЕНИЕ ТРЁХ ЛЕТ, ПОМИМО ДВУХ ЛЕТ В ТЕЧЕНИИ КОТОРЫХ ЭТА ВЕРСИЯ БУДЕТ ПОСЛЕДНЕЙ. ЕСЛИ ВЫ ВСЕГДА СТРЕМИТЕСЬ ЗА НОВИНКАМИ, ТО ВЫБИРАЙТЕ ОБЫЧНУЮ ВЕРСИЮ И ОБНОВЛЯЙТЕ РЕЛИЗ (СМ. ВЕРСИЯ) КАЖДЫЕ ПОЛГОДА. ЕСЛИ ЖЕ ВЫ ХОТИТЕ НАСТРОИТЬ СИСТЕМУ И ОСТАВИТЬ ЕЁ В ПОКОЕ, ТО ВЫБИРАЙТЕ LTS И ТОГДА АПГРЕЙД НА СЛЕДУЮЩИЙ РЕЛИЗ БУДЕТЕ ДЕЛАТЬ РАЗ В ДВА ГОДА, ЕСЛИ ХОТИТЕ ОСТАВАТЬСЯ ВСЕГДА НА LTS РЕЛИЗАХ. ЗАМЕТЬТЕ НИЧТО НЕ МЕШАЕТ ОБНОВЛЯТЬ LTS ВЕРСИЮ НА ОБЫЧНУЮ КАЖДЫЕ ПОЛ ГОДА.\r\n\r\nВЫБОР МЕЖДУ 32BIT ИЛИ 64BIT\r\n\r\nДАЛЕЕ НУЖНО БУДЕТ ВЫБРАТЬ МЕЖДУ 32-БИТНОЙ И 64-БИТНОЙ ВЕРСИЕЙ СИСТЕМЫ. ПОМНИТЕ, ЧТО ПОДОБНО WINDOWS, У 64-БИТНОЙ ВЕРСИИ UBUNTU БУДЕТ БОЛЬШЕ ПРОБЛЕМ СОВМЕСТИМОСТИ, ЧЕМ У ЕЁ 32-БИТНОГО АНАЛОГА. С ПОДДЕРЖКОЙ ДРАЙВЕРОВ ТОЖЕ МОГУТ ВОЗНИКНУТЬ ПРОБЛЕМЫ НА 64-БИТНОЙ ПЛАТФОРМЕ. В КОНЕЧНОМ СЧЁТЕ, ВЫБОР ЗА ВАМИ, 64-БИТНАЯ ВЕРСИЯ МОЖЕТ ДАТЬ БОЛЬШУЮ ПРОИЗВОДИТЕЛЬНОСТЬ, НО 32-БИТНЫЕ СИСТЕМЫ ДОСТАВЯТ МЕНЬШЕ ХЛОПОТ, А КАК ДЛЯ НАЧИНАЮЩЕГО ПОЛЬЗОВАТЕЛЯ ЭТО ОЧЕНЬ ВАЖНО. СПРОСИТЕ: А КАК НАСЧЕТ ПОДДЕРЖКИ ОПЕРАТИВНОЙ ПАМЯТИ БОЛЕЕ 4ГБ? ОТВЕТ ПРОСТ - НУЖНО ЛИШЬ БУДЕТ ЧЕРЕЗ ГРАФИЧЕСКИЙ МЕНЕДЖЕР ПАКЕТОВ УСТАНОВИТЬ ЯДРО С ИНДЕКСОМ «PAE».\r\n\r\nСКАЧИВАНИЕ\r\n\r\nИТАК, ВЫ ОПРЕДЕЛИЛИСЬ, КАКУЮ ВЕРСИЮ UBUNTU БУДЕТЕ ИСПОЛЬЗОВАТЬ. ПЕРЕХОДИМ ПО ССЫЛКЕ ДЛЯ СКАЧИВАНИЯ UBUNTU, В ПОЛЕ «CHOOSE YOUR FLAVOUR» ВЫБИРАЕМ 32-БИТНУЮ ИЛИ 64-БИТНУЮ ВЕРСИЮ, ЖМЕМ «GET UBUNTU XX.XX». ВОЗМОЖНО ПОСЛЕ ЭТОГО ВАМ БУДЕТ ПРЕДЛОЖЕНО ОТВЕТИТЬ НА ОПРОС, НО СЕЙЧАС НАС ЭТО НЕ ИНТЕРЕСУЕТ, В КОНЦЕ СТРАНИЦЫ НАЖИМАЕМ «NOT NOW, TAKE ME TO THE DOWNLOAD ›»(ПЕРЕВОД «НЕ СЕЙЧАС, ПРИСТУПИТЬ К ЗАГРУЗКЕ >»). ПОСЛЕ ЭТОГО ОТКРОЕТСЯ СТРАНИЦА ЗАГРУЗКИ И ЧЕРЕЗ НЕСКОЛЬКО СЕКУНД НАЧНЕТСЯ ЗАГРУЗКА. ОБРАЗ *.ISO ДИСТРИБУТИВА UBUNTU ЗАНИМАЕТ РАЗМЕР ОКОЛО 700 МБ, ПОЭТОМУ РЕКОМЕНДУЕТСЯ ИСПОЛЬЗОВАТЬ МЕНЕДЖЕР ЗАКАЧКИ, ДЛЯ ТОГО, ЧТО БЫ МОЖНО БЫЛО ДОКАЧАТЬ ОБРАЗ В СЛУЧАЕ РАЗРЫВА СОЕДИНЕНИЯ.\r\n'),
(16, '16cbbb61d07140ae4aa9a5f8170cf25f', 'ПОИСК УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ НА САЙТЕ\r\n12 БЕСПЛАТНЫХ ИНСТРУМЕНТОВ ДЛЯ ПОИСКА УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ НА САЙТЕ\r\n\r\nОДНИМ ИЗ НАИБОЛЕЕ ВАЖНЫХ ВОПРОСОВ В ОБЛАСТИ ИНФОРМАЦИОННЫХ ТЕХНОЛОГИЙ ЯВЛЯЕТСЯ БЕЗОПАСНОСТЬ. ЗНАЕТЕ ЛИ ВЫ, ЧТО 96% ТЕСТИРУЕМЫХ ПРИЛОЖЕНИЙ ИМЕЮТ УЯЗВИМОСТИ?\r\n\r\nНИЖЕ ПРИВЕДЕНА ДИАГРАММА ОТ CENZIC, НА КОТОРОЙ ПОКАЗАНЫ РАЗЛИЧНЫЕ ТИПЫ НАЙДЕННЫХ УЯЗВИМОСТЕЙ.\r\n\r\nВ ЭТОЙ СТАТЬЕ Я РАССКАЖУ О БЕСПЛАТНЫХ ИНСТРУМЕНТАХ ДЛЯ СКАНИРОВАНИЯ САЙТА НА НАЛИЧИЕ УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ.\r\n12 БЕСПЛАТНЫХ ИНСТРУМЕНТОВ ДЛЯ ПОИСКА УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ НА САЙТЕ\r\n\r\nОДНИМ ИЗ НАИБОЛЕЕ ВАЖНЫХ ВОПРОСОВ В ОБЛАСТИ ИНФОРМАЦИОННЫХ ТЕХНОЛОГИЙ ЯВЛЯЕТСЯ БЕЗОПАСНОСТЬ. ЗНАЕТЕ ЛИ ВЫ, ЧТО 96% ТЕСТИРУЕМЫХ ПРИЛОЖЕНИЙ ИМЕЮТ УЯЗВИМОСТИ?\r\n\r\nНИЖЕ ПРИВЕДЕНА ДИАГРАММА ОТ CENZIC, НА КОТОРОЙ ПОКАЗАНЫ РАЗЛИЧНЫЕ ТИПЫ НАЙДЕННЫХ УЯЗВИМОСТЕЙ.\r\n\r\nВ ЭТОЙ СТАТЬЕ Я РАССКАЖУ О БЕСПЛАТНЫХ ИНСТРУМЕНТАХ ДЛЯ СКАНИРОВАНИЯ САЙТА НА НАЛИЧИЕ УЯЗВИМОСТЕЙ И ВРЕДОНОСНЫХ ПРОГРАММ.\r\nСПИСОК РАССМАТРИВАЕМЫХ ИНСТРУМЕНТОВ:\r\n\r\nSCAN MY SERVER;\r\nSUCURI;\r\nQUALYS SSL LABS, QUALYS FREESCAN;\r\nQUTTERA;\r\nDETECTIFY;\r\nSITEGUARDING;\r\nWEB INSPECTOR;\r\nACUNETIX;\r\nASAFA WEB;\r\nNETSPARKER CLOUD;\r\nUPGUARD WEB SCAN;\r\nTINFOIL SECURITY.\r\n1. SCAN MY SERVER\r\nSCANMYSERVER ПРЕДОСТАВЛЯЕТ ОДИН ИЗ САМЫХ ПОЛНЫХ ОТЧЕТОВ ПО ТЕСТАМ БЕЗОПАСНОСТИ: SQL-ИНЪЕКЦИЯМ, МЕЖСАЙТОВОМУ СКРИПТИНГУ, ИНЪЕКЦИЯМ PHP-КОДА, РАСКРЫТИЮ ИСТОЧНИКА, УСТАНОВКЕ HTTP-ЗАГОЛОВКОВ И МНОГОЕ ДРУГОЕ.\r\nОТЧЕТ О ПРОВЕРКЕ ОТПРАВЛЯЕТСЯ ПО ЭЛЕКТРОННОЙ ПОЧТЕ С КРАТКИМ ОПИСАНИЕМ НАЙДЕННЫХ УЯЗВИМОСТЕЙ.\r\n\r\n2. SUCURI\r\nSUCURI ЯВЛЯЕТСЯ САМЫМ ПОПУЛЯРНЫМ БЕСПЛАТНЫМ СКАНЕРОМ ВРЕДОНОСНЫХ ПРОГРАММ. ВЫ МОЖЕТЕ БЫСТРО ПРОТЕСТИРОВАТЬ САЙТ НА НАЛИЧИЕ ВРЕДОНОСНОГО КОДА, SPAM-ИНЪЕКЦИЙ И ЕГО ПРИСУТСТВИЕ В РАЗЛИЧНЫХ ЧЕРНЫХ СПИСКАХ.\r\n\r\nSUCURI ТАКЖЕ ОЧИЩАЕТ И ЗАЩИЩАЕТ САЙТ ОТ ОНЛАЙН-УГРОЗ. ИНСТРУМЕНТ РАБОТАЕТ НА ЛЮБЫХ CMS, ВКЛЮЧАЯ WORDPRESS, JOOMLA, MAGENTO, DRUPAL, PHPBB И Т. Д.\r\n\r\n3. QUALYS SSL LABS, QUALYS FREESCAN\r\n\r\nSSL LABS ЯВЛЯЕТСЯ ОДНИМ ИЗ ПОПУЛЯРНЫХ ИНСТРУМЕНТОВ ДЛЯ СКАНИРОВАНИЯ ВЕБ-СЕРВЕРА SSL. ОН ОБЕСПЕЧИВАЕТ УГЛУБЛЕННЫЙ АНАЛИЗ HTTPS URL-АДРЕСА, ОБЩИЙ РЕЙТИНГ, ШИФР, ВЕРСИЮ SSL / TLS, ИМИТАЦИЮ РУКОПОЖАТИЙ, ИНФОРМАЦИЮ О ПРОТОКОЛЕ, BEAST И МНОГОЕ ДРУГОЕ.\r\n\r\nFREESCAN ПРОВЕРЯЕТ САЙТЫ НА OWASP TOP RISKS И ВРЕДОНОСНЫЕ ПРОГРАММЫ, ПО ПАРАМЕТРАМ БЕЗОПАСНОСТИ SCP, А ТАКЖЕ ВЫПОЛНЯЕТ ДРУГИЕ ТЕСТЫ. ЧТОБЫ ВЫПОЛНИТЬ СКАНИРОВАНИЕ, НЕОБХОДИМО ЗАРЕГИСТРИРОВАТЬ БЕСПЛАТНУЮ УЧЕТНУЮ ЗАПИСЬ.\r\n\r\n4. QUTTERA\r\nQUTTERA ПРОВЕРЯЕТ САЙТ НА НАЛИЧИЕ ВРЕДОНОСНЫХ ПРОГРАММ И УЯЗВИМОСТЕЙ.\r\n\r\nЭТОТ ИНСТРУМЕНТ СКАНИРУЕТ САЙТ НА НАЛИЧИЕ ВРЕДОНОСНЫХ ФАЙЛОВ, ПОДОЗРИТЕЛЬНЫХ ФАЙЛОВ, ПОТЕНЦИАЛЬНО ПОДОЗРИТЕЛЬНЫХ ФАЙЛОВ, PHISHTANK, А ТАКЖЕ ПРИСУТСТВИЕ В СПИСКАХ БЕЗОПАСНОГО ПРОСМОТРА (GOOGLE, YANDEX) И СПИСКАХ ВРЕДОНОСНЫХ ПРОГРАММ.\r\n5. DETECTIFY\r\nDETECTIFY — ЭТО СКАНЕР САЙТА, ОСНОВАННЫЙ НА SAAS. ОН ПОЗВОЛЯЕТ ПРОВОДИТЬ БОЛЕЕ 100 АВТОМАТИЧЕСКИХ ТЕСТОВ БЕЗОПАСНОСТИ, ВКЛЮЧАЯ ТЕСТ OWASP TOP 10, НАЛИЧИЕ ВРЕДОНОСНОГО ПРОГРАММНОГО ОБЕСПЕЧЕНИЯ И МНОГИЕ ДРУГИЕ.\r\n');

